  assert_equal(EXCEL_STRING("Extra text"), detailed_lever_guides_ac5(), "'Detailed lever guides'!AC5");
  assert_equal(EXCEL_STRING("This lever controls the total number of people in the world in 2050.  There is no level 4 for this choice, so level 3 represents the lowest population estimate."), detailed_lever_guides_u6(), "'Detailed lever guides'!U6");
  assert_equal(EXCEL_STRING("The number of people in the world has a big impact on the energy and land system, as a higher population will increase demand for food, manufactured goods, transport, and buildings. However, the future population growth trajectory is very uncertain. This lever allows you to explore the UN’s range of projections, so that you can see how this uncertainty impacts on emissions and temperature change.\r\rAccording to UN estimates, the world’s population was 6.9 billion in 2011, and by 2014 it was increasing by about 82 million each year. Fertility in developing countries has fallen over the last two decades. However, because birth rates in developing countries tend to be much higher than in developed ones, and because of their younger population structures, it is expected that most of the growth between now and 2050 will be concentrated in developing regions. This means that the total population in 2050 will depend particularly on how fertility changes in developing countries over the next few decades. "), detailed_lever_guides_v6(), "'Detailed lever guides'!V6");
  assert_equal(EXCEL_STRING("Because population is such an important driver of demand, this lever affects almost all the other levers in the Global Calculator. This lever links with the urbanisation level, because energy trends in urban areas have historically been very different to rural areas.\r\rHistorically, fertility has generally fallen as countries develop and people get wealthier. Choosing a lower population growth rate using this lever could therefore simulate one of the effects of economic development. \r\rBecause of these reductions in fertility and increased life expectancies, most countries in the world now have ageing populations. This ageing could have negative impacts on economies in the future, as health and pension costs increase while the proportion of people of working age reduces. In developed countries, this ageing trend is more established and is already putting pressure on health and welfare budgets. Many developing countries are expected to enter a period of rapid ageing soon. Although reductions in fertility in the future would make it comparatively easier to tackle climate change, these negative impacts should also be taken into account when choosing a level for this lever. "), detailed_lever_guides_w6(), "'Detailed lever guides'!W6");
  assert_equal(EXCEL_STRING("With a population of 10.9 billion, this is the UN’s high-variant scenario, in which the average woman has around 2.7 children in 2050 (on average, 0.5 more children more than the medium-variant scenario)."), detailed_lever_guides_x6(), "'Detailed lever guides'!X6");
  assert_equal(EXCEL_STRING("With a population of 9.6 billion, this is the UN’s medium-variant scenario, in which global fertility falls from 2.53 children per woman between 2005-2010, to 2.24 in 2045-2050. This assumes steep fertility declines in countries with the highest birth rates today, and a slight increase in countries with low fertility."), detailed_lever_guides_y6(), "'Detailed lever guides'!Y6");
  assert_equal(EXCEL_STRING("With a population of 8.3 billion, this is the UN’s low-variant scenario, in which the average woman has around 1.7 children (on average, 0.5 fewer children than the medium-variant scenario). "), detailed_lever_guides_z6(), "'Detailed lever guides'!Z6");
  assert_equal(EXCEL_STRING("This lever only has three levels."), detailed_lever_guides_aa6(), "'Detailed lever guides'!AA6");
  assert_equal(EXCEL_STRING("1 Scenario data is sourced from UN data: http://esa.un.org/wpp/documentation/pdf/WPP2012_%20KEY%20FINDINGS.pdf\r"), detailed_lever_guides_ab6(), "'Detailed lever guides'!AB6");
  assert_equal(EXCEL_STRING("This lever controls the proportion of the world’s population living in urban areas.  There is no level 4 for this choice."), detailed_lever_guides_u7(), "'Detailed lever guides'!U7");
  assert_equal(EXCEL_STRING("Urban areas have denser populations than rural ones, so urban lifestyles have the potential for greater energy efficiency because of smaller homes, shorter travel distances and greater access to public transport. However, in developing countries, urban areas usually offer a much higher standard of living than in rural areas, with increased access to electricity, consumer goods and cars. This means that urbanisation is a big driver of increased energy demand globally.\r\rIn 2011, 52% of the global population lived in urban areas. There has been a strong upward trend, as only 30% of people lived in towns and cities in 1950. Today, developed countries are more urbanised than developing ones, however many forecasts anticipate a big increase in urbanisation in developing countries over the next few decades as economies grow. Urban areas are expected to absorb all the population increase by 2050, and will also draw in some of the rural population."), detailed_lever_guides_v7(), "'Detailed lever guides'!V7");
  assert_equal(EXCEL_STRING("Although urbanisation does increase energy demand per capita in developing countries, and therefore emissions, it often happens because of shortages of jobs in rural areas caused by agricultural modernisation, and growth in paid jobs in urban areas. Moving to towns or cities can also offer huge benefits to the people involved through better access to education, health care and entertainment. Lower urbanisation levels in the future could have a big impact on development.\r\rIf urbanisation is not properly planned, it can lead to urban sprawl and huge traffic problems, removing the energy efficiency benefit of living in more compact areas and also having a negative impact on quality of life. However if urban infrastructures are planned as cities grow, then energy demand per person can be reduced by designing smarter transport systems and providing housing for people closer to work."), detailed_lever_guides_w7(), "'Detailed lever guides'!W7");
  assert_equal(EXCEL_STRING("Under the level 1 scenario, 75% of the global population live in urban areas. This represents an acceleration of current urbanisation trends, particularly in developing countries. By 2050 the world average is similar to that of the developed world today. This is the high urbanisation estimate from the UN “World Population Prospects, the 2011 Revision”."), detailed_lever_guides_x7(), "'Detailed lever guides'!X7");
  assert_equal(EXCEL_STRING("This is the UN’s central estimate of urbanisation. In this scenario, urbanisation continues in both developed and developing countries, but at a slower rate than in level 1. By 2050, 86% of people in developed regions would live in urban areas, and 64% in developing regions."), detailed_lever_guides_y7(), "'Detailed lever guides'!Y7");
  assert_equal(EXCEL_STRING("Under this scenario, 58% of the global population live in urban areas. In this scenario, the urbanisation rate slows. This could be because of a lack of resources like water and land, or because of challenges like traffic congestion and air pollution, or because people prefer to live in smaller towns. This is the low urbanisation estimate from the UN “World Population Prospects, the 2011 Revision”."), detailed_lever_guides_z7(), "'Detailed lever guides'!Z7");
  assert_equal(EXCEL_STRING("This lever only has three levels."), detailed_lever_guides_aa7(), "'Detailed lever guides'!AA7");
  assert_equal(EXCEL_STRING("1 UN “World Population Prospects, the 2011 Revision”.\r2 The definition of urban settlements is based on the UN categorisation, described in this report: http://esa.un.org/unpd/wup/Highlights/WUP2014-Highlights.pdf"), detailed_lever_guides_ab7(), "'Detailed lever guides'!AB7");
  assert_equal(EXCEL_STRING("This lever control the distance people will travel. Specifically, it controls the average annual distance travelled per person within urban areas, rural areas and internationally. "), detailed_lever_guides_u8(), "'Detailed lever guides'!U8");
  assert_equal(EXCEL_STRING("Passenger transport includes transport of people by road, rail, air and ship.  Passenger transport accounted for 60% of total transport energy demand in 2011, with the remaining 40% for freight.  Historically, travel distance per person has steadily increased. Recently, in some areas, like major transit cities such as London, distance per person has stagnated. At the same time, there has been extremely fast growth in travel demand in cities within developing countries over recent decades. The Global Calculator model distinguishes between 6 different types of region which have different travel behaviour. Urban areas are classified as automobile cities (cities that are spread out, such as Los Angeles), transit cities (cities that are relatively compact, such as Paris) and booming cities (new or expanding cities, such as Mumbai). Rural areas are classed as developed or developing.  International travel is defined as long distance travel, by air or to some extent train."), detailed_lever_guides_v8(), "'Detailed lever guides'!V8");
  assert_equal(EXCEL_STRING("Historically, increases in travel demand have been correlated with growth in GDP. However, development of more flexible and digital working habits might diminish this correlation in the future. City planning can also have a significant impact on average distance travelled per person. The user may want to consider other transport levers at the same time as this. In particular, the “mode” lever determines what share of travel is made by car, train or plane; and the “occupancy & load” lever determines how many people are in the average car. Better city design can help to reduce both the passenger distance travelled and enable mode switch or boost car occupancy levels. Note that the “car own or hire” lever does not influence demand for car trips or car occupancy.  Instead, it allows the user to explore the cost implications of having fewer cars on the road through more car hire schemes.\r"), detailed_lever_guides_w8(), "'Detailed lever guides'!W8");
  assert_equal(EXCEL_STRING("Very high growth in travel distance per person, with no efforts to constrain it."), detailed_lever_guides_x8(), "'Detailed lever guides'!X8");
  assert_equal(EXCEL_STRING("This represents a situation where some action is taken to curtail growth in  passenger distance travelled.  Cities with established development patterns as well as growing cities pursue initiatives to reduce the need for travel throughout the city. "), detailed_lever_guides_y8(), "'Detailed lever guides'!Y8");
  assert_equal(EXCEL_STRING("Cities with established development patterns as well as growing cities pursue initiatives to reduce the need for travel throughout the city via ‘smart’ city planning. Global distance travelled per person increases but less dramatically."), detailed_lever_guides_z8(), "'Detailed lever guides'!Z8");
  assert_equal(EXCEL_STRING("Cities make a significant effort to develop as transit-oriented, multi-use cities along with significant advances in communication technologies. In ‘automobile cities’ (such as Atlanta), travel distance would decrease under this scenario. \r"), detailed_lever_guides_aa8(), "'Detailed lever guides'!AA8");
  assert_equal(EXCEL_STRING("This lever controls how much freight will be transported in the world and how far it will travel. It includes freight transport by road, ship and plane.\r"), detailed_lever_guides_u9(), "'Detailed lever guides'!U9");
  assert_equal(EXCEL_STRING("The amount of freight transported every year has begun to increase rapidly over the last decade, as demand for goods has increased and industry has become more globalised. By reducing freight demand or the distance the freight needs to travel, we can reduce the amount of journeys taken by trucks, trains and ships, therefore reducing energy demand and emissions.\r"), detailed_lever_guides_v9(), "'Detailed lever guides'!V9");
  assert_equal(EXCEL_STRING("The user can use the \"occupancy and load\" lever to further increase the efficiency of freight trips without impacting freight demand itself, by increasing the load factor (for example, vehicles carrying heavier loads or minimising empty  journeys). You can also reduce the impact of freight on emissions by using the \"mode\" and \"transport efficiency\" levers.\r\rFreight demand is strongly correlated with GDP because it is related to economic activity. In the future inventions like 3D printers may have a significant impact on freight demand and could decouple it from GDP. However, raw materials will still need to be shipped to the location of consumption.\r\rUsers are advised to check whether their freight demand lever setting is consistent with settings for other levers in their pathway.  To do this, use the “freight by load” graphic in the web tool.  This shows growth in international freight by sea alongside growth in coal, oil and iron products between 2011 and 2050.  Coal, oil and iron products currently account for around two thirds of global international freight by sea (International Maritime Organisation (2009 based on UNCTAD data 2006)) so it is useful to check whether they follow similar trends.  Users can reduce demand for iron products by reducing the demand for manufactured products (e.g. reduce the number of cars using the “mode” lever).  Users can reduce oil and coal consumption by making their pathway less fossil fuel dependent.\r"), detailed_lever_guides_w9(), "'Detailed lever guides'!W9");
  assert_equal(EXCEL_STRING("Very high growth in freight demand. Freight transport more than doubles between 2011 and 2050.\r"), detailed_lever_guides_x9(), "'Detailed lever guides'!X9");
  assert_equal(EXCEL_STRING("Global freight continues to experience strong growth. \r"), detailed_lever_guides_y9(), "'Detailed lever guides'!Y9");
  assert_equal(EXCEL_STRING("Under this scenario, freight demand does not rise as quickly. This could be due to ‘smarter’ technologies or having more local freight distribution processes. \r"), detailed_lever_guides_z9(), "'Detailed lever guides'!Z9");
  assert_equal(EXCEL_STRING("Global freight breaks its historically strong growth pattern. While it still increases, there is much less correlation with global GDP growth. This could be driven by technology improvements (e.g. 3D printers reducing the need for freight) or infrastructure investments.   This could also be consistent with a world which has become less globalised and is increasingly manufacturing and consuming products more locally.\r"), detailed_lever_guides_aa9(), "'Detailed lever guides'!AA9");
  assert_equal(EXCEL_STRING("The transport mode lever controls the proportion of passenger transport made by walking, cycling, motorbike, car, bus, train, aeroplane and boat. It also controls the proportion of freight transport made by road, rail and air.\r"), detailed_lever_guides_u10(), "'Detailed lever guides'!U10");
  assert_equal(EXCEL_STRING("The mode by which people and freight travel has a big impact on energy use and emissions. For passenger travel, the proportion of car use in the mix is particularly important, as cars have high emissions per person compared to public transport.  Historically, car use increases as countries develop and cars become more affordable. \r\rFor freight, rail has lower emissions factor per tonne-km, but will require a large infrastructure investment globally if it is to maintain its current share.\r"), detailed_lever_guides_v10(), "'Detailed lever guides'!V10");
  assert_equal(EXCEL_STRING("Although growth in car ownership has long been associated with increasing prosperity, a shift to public transport, walking or cycling does not necessarily mean less convenience for passengers and a lower quality of life. If cities are carefully planned with integrated transport systems, journeys may be quicker by public transport. Quality of life can be improved by spending less time stuck on congested roads.  \r\rHowever, the development of public transport infrastructure and urban planning usually requires significant public investment, whereas the growth of car use involves the spending of mostly private money. This means that considerable political and civic effort must be made to produce the shift in transport mode seen in levels 3 and 4. \r\rWhen choosing the lever setting for “mode”, users should also consider their choices for “passenger distance” and “freight distance”.  For example, if passenger and freight distance are set at level 1 (very high growth), then setting mode at level 4 may be unrealistic because it tends to be more difficult to travel long distances by walking, cycling or public transport. \r\rThe user’s choice in the transport mode lever also affects the impact of the “electric and hydrogen” and “transport efficiency” levers – lowering the average emission factor of a car will make more of a difference if there are many car.  \r"), detailed_lever_guides_w10(), "'Detailed lever guides'!W10");
  assert_equal(EXCEL_STRING("Car use continues to increase with GDP, with particularly high increases in the developing world. No effort to reduce urban sprawl, or to invest in rail and public transport infrastructure. \r"), detailed_lever_guides_x10(), "'Detailed lever guides'!X10");
  assert_equal(EXCEL_STRING("Cities make an effort to shift trips to walking, cycling and public transport instead of by car. Some effort in logistics and rail infrastructure.\r"), detailed_lever_guides_y10(), "'Detailed lever guides'!Y10");
  assert_equal(EXCEL_STRING("Cities make substantial effort to stem the shift towards cars and create incentives for walking, cycling, public transport and 2-3 wheelers. \r"), detailed_lever_guides_z10(), "'Detailed lever guides'!Z10");
  assert_equal(EXCEL_STRING("Cities make extreme effort to shift people away from private vehicles as well as reduce travel demand. This level represents extreme effort on rail infrastructure and logistics.\r"), detailed_lever_guides_aa10(), "'Detailed lever guides'!AA10");
  assert_equal(EXCEL_STRING("This lever controls the occupancy of passenger vehicles, for example, the number of people in the average car, bus or train. It also controls the load factor for freight vehicles, which is the weight of goods for each type of freight vehicle.\r"), detailed_lever_guides_u11(), "'Detailed lever guides'!U11");
  assert_equal(EXCEL_STRING("While most cars have more than two seats, their occupancy tends to be less than 2 people. Similar, many freight transport vehicles are not loaded to their full capacity.\rHistorically, freight transport load factors have increased due to improved logistics and distribution systems.  In contrast, car occupancy has decreased. An explanation might be the increasing global wealth allowing for more car ownership and greater diversity of activities and destinations available to people. People who may have originally travelled as a group or used public transport, go now with their own cars.\r\rHowever the increased congestion and parking costs in some urban areas may make car-pooling a more appealing prospect in the future. \r"), detailed_lever_guides_v11(), "'Detailed lever guides'!V11");
  assert_equal(EXCEL_STRING("Car sharing could be boosted in a number of different ways.  Firstly, technological developments (such as smart phone apps) make it easier for people to coordinate ride-shares more easily.  Secondly, political initiatives can be helpful. Los Angeles, for instance, has lanes exclusively for high occupancy vehicles. In Mexico different car registrations are restricted from the city center on certain days, forcing people to carpool more or switch to public transport.\r\rTechnological developments could also help increase freight load.  For example, applications to that ensure that a freight vehicle is as heavily loaded as possible during its journey. \r\rFor a given setting for “passenger distance”, “freight distance” and “mode”, increasing effort on “occupancy and load” will reduce transport energy demand and the number of vehicles required.\r"), detailed_lever_guides_w11(), "'Detailed lever guides'!W11");
  assert_equal(EXCEL_STRING("Under this scenario, people continue to prefer single-occupancy driving, and public transport occupancy levels are relatively low. Car occupancy falls by 10% from 2011 levels. This is similar to the level seen in Austria today.\r"), detailed_lever_guides_x11(), "'Detailed lever guides'!X11");
  assert_equal(EXCEL_STRING("Car occupancy remains at 2011 levels, which is around the same as the occupancy seen in the United Kingdom today. \r"), detailed_lever_guides_y11(), "'Detailed lever guides'!Y11");
  assert_equal(EXCEL_STRING("Vehicle occupancy increases, possibly driven by technology which makes car-pooling easier and which plans public transport logistics more efficiently. Car occupancy increases by 10%, while improved logistics and coordination improves freight load factors.\r"), detailed_lever_guides_z11(), "'Detailed lever guides'!Z11");
  assert_equal(EXCEL_STRING("In level 4, regulatory constraints, costs, and smarter digital applications to coordinate our car demand makes car-pooling more attractive. In 2050 car occupancy is 20% higher than today and the average occupancy for other transport is also higher. With investment in logistics, load factors for freight increase by an unprecedented level. \r"), detailed_lever_guides_aa11(), "'Detailed lever guides'!AA11");
  assert_equal(EXCEL_STRING("This lever allows the user to simulate the effect of a shift towards increasing levels of car hire (rather than ownership).  Increasing levels of car hire result in an increase in average distance travelled per car and a fall in the total number of cars.\r"), detailed_lever_guides_u12(), "'Detailed lever guides'!U12");
  assert_equal(EXCEL_STRING("Historically, as countries become richer, car ownership levels increase. If people continue to own private vehicles at the current rate or increased rate, then we will have significantly more vehicles, but perhaps without intensive usage.  In some parts of the world, where many families own a car (or even two cars), these vehicles are often only used for a small proportion of the day and week. This is often expensive, and it may be that in future people begin to move away from owning their own vehicles.\r\rOne option in the future is hiring cars or motorbikes from a company or government scheme, or as an informal arrangements among households or neighbours, allowing people to drive similar distances as today, but using a fleet of shared vehicles.  Hiring a vehicle or car-sharing would decrease the stock of cars needed, and the associated manufacturing energy demand and emissions impacts. Signs of these trends are already emerging and some schemes have already achieved success in city areas.\r\rAn additional step could be self-driving or autonomous vehicles, which is a technology that could radically change the way we travel. They could offer all of the conveniences of taxis as well as maximizing the use time and road space, so if the cost become comparable or cheaper than owning a car, it could drastically decrease car ownership. It could also have the potential to work in rural areas where lower population density may make car hire schemes less popular. \r"), detailed_lever_guides_v12(), "'Detailed lever guides'!V12");
  assert_equal(EXCEL_STRING("The “car own or hire” lever does not impact upon the amount of car travel that takes place or the occupancy of the average car.  Rather, this lever allows the user to simulate the effect of increased car hire.\r\rThis lever has a significant impact on total energy system costs.  If we move towards more car hire, then we do not have to buy as many cars.  This impact can be viewed in the 'costs' tab.\r\rSome people believe that a switch to self-driving vehicles will coincide with a switch to low carbon engines. If so, then transport technology options under \"transport efficiency\" and \"electric and hydrogen\" should be considered.\r"), detailed_lever_guides_w12(), "'Detailed lever guides'!W12");
  assert_equal(EXCEL_STRING("The average car travels 20% fewer km than today, with little sharing or hiring of vehicles. Cars remain an important luxury item and people want to own their own car, even if they use it less due to increased congestion. There are no incentive systems to share your car with others.\r"), detailed_lever_guides_x12(), "'Detailed lever guides'!X12");
  assert_equal(EXCEL_STRING("The distance travelled per car is the same as today’s levels. Similar to today, car hiring or sharing is a niche concept. The vast majority of cars remain to be privately owned and used.\r"), detailed_lever_guides_y12(), "'Detailed lever guides'!Y12");
  assert_equal(EXCEL_STRING("The average urban vehicle travels twice as far in 2050 than in 2011 (rural vehicles travel 50% of the 2011 distance). This would be a world where many people in urban areas share or hire cars, rather than owning their own vehicle. Incentives  or high costs of owning a car may support the car sharing communities, or there may be significant use of self-driving cars.\r"), detailed_lever_guides_z12(), "'Detailed lever guides'!Z12");
  assert_equal(EXCEL_STRING("The average urban vehicle travels 260% further than 2011 (with rural vehicles travelling double the 2011 distance). Car sharing and self-driving cars are probably a mainstream feature, and are optimised to make the best use of the system.\r"), detailed_lever_guides_aa12(), "'Detailed lever guides'!AA12");
  assert_equal(EXCEL_STRING("1 http://en.wikipedia.org/wiki/Autolib‘\r2 http://www.bbc.co.uk/news/technology-27587558\r\r"), detailed_lever_guides_ab12(), "'Detailed lever guides'!AB12");
  assert_equal(EXCEL_STRING("This lever controls the efficiency of vehicles. It controls efficiency improvements for all vehicle types (both fossil fuel-powered and low-carbon) within the model. It also includes both passenger and freight transport. \r"), detailed_lever_guides_u13(), "'Detailed lever guides'!U13");
  assert_equal(EXCEL_STRING("Recently there has been a strong focus on improving the fuel efficiency of cars – for example, the fleet consumption of Daimler fell by about 50% between 1990 and 2012 to around 6.5 litres per 100 km. This was achieved by technology improvements (cylinder capacity and turbo charging) and regulatory efforts such as lower-limits for fleet efficiencies.\r\rIt may be harder for fossil-fuel-powered car engine efficiencies to make future improvements given the quick progress in the past few years. However, car efficiency could be improved by decreasing the average car weight so that less fuel is needed. Policy approaches might be able to increase average transport efficiency by setting more severe upper speed limits for cars which would run more efficiently at lower speeds – but this may not be politically acceptable.\r\rThe efficiency of planes has also improved over the last decades. The jumbo jet A380 is 12% more efficient than a Boeing 747.  Planes have been considerably optimised in the last years, possibly suggesting that fewer significant improvements can be expected. Replacing fossil fuel by hydrogen might not help to reduce the climate impact of flying as water vapour acts as a strong greenhouse gas. When directly emitted in the stratosphere, water vapour can persist for months and years and might also degrade the ozone layer. \r\rSignificant research efforts are going into low-emission vehicles, meaning that efficiency improvements are also likely for hydrogen-powered and electric vehicles.\r"), detailed_lever_guides_v13(), "'Detailed lever guides'!V13");
  assert_equal(EXCEL_STRING("This lever applies to all vehicles, and links with other choices made, especially “electric and hydrogen” and “occupancy and load”. There are several ways to enhance vehicle efficiency, such as improving the engine or aerodynamic performance of vehicles, using lighter materials to reduce the ratio weight per person, or changes in driving behaviour (for example, braking less or travelling at lower speeds).\r\rFossil fuel-powered transport can be divided into two main areas: passenger and freight transport. For passenger transport, public transport (especially electric trains, trams and buses) is about 5 to 10 times more energy-efficient than other forms of transport (e.g. cars and planes).\r\rFor freight transport, in 2011 light-duty vehicles had an efficiency of 10 litres gasoline equivalent (lge) per 100km and heavy-duty vehicle efficiency was 32 lge per 100km. The average global rate of improvement is 1-2% per year. International shipping is more efficient in fossil fuel use and is also compatible with biofuels, whereas nuclear reactor driven ships have cargo transport cost as low as 0.14 kWh per ton and km and can travel 500,000 km without refueling.\r"), detailed_lever_guides_w13(), "'Detailed lever guides'!W13");
  assert_equal(EXCEL_STRING("This assumes less improvement in efficiency than has been achieved over the last decades. For example by 2050 the average urban passenger car (with an internal combustion engine) will use 5.9 litres of fuel per 100km. \r"), detailed_lever_guides_x13(), "'Detailed lever guides'!X13");
  assert_equal(EXCEL_STRING("Level 2 assumes annual improvement roughly corresponding with improvements achieved over the last decades. For example, by 2050 the average urban passenger car (with an internal combustion engine) will use 5.3 litres of fuel per 100km. \r"), detailed_lever_guides_y13(), "'Detailed lever guides'!Y13");
  assert_equal(EXCEL_STRING("Level 3 surpasses improvement rates of the last couple of decades. For example, by 2050 the average urban passenger car (with an internal combustion engine) will use 4.3 litres of fuel per 100km. \r"), detailed_lever_guides_z13(), "'Detailed lever guides'!Z13");
  assert_equal(EXCEL_STRING("This scenario entails that cars, trucks and trains would use only half as much fuel in 2050 for the same distance travelled in 2011. For example, by 2050 the average urban passenger car (with an internal combustion engine) will use 3.6 litres of fuel per 100km. \r"), detailed_lever_guides_aa13(), "'Detailed lever guides'!AA13");
  assert_equal(EXCEL_STRING("This lever controls how much the vehicle fleet will move from fossil fuels to lower emission vehicles. These include  hybrid, electric or hydrogen vehicles and their use for passenger, freight and international transport. "), detailed_lever_guides_u14(), "'Detailed lever guides'!U14");
  assert_equal(EXCEL_STRING("Transport is one of the major contributors to global emissions, and is still heavily reliant on fossil fuels. For example, in 2011, 99% of passenger cars were powered by fossil fuel based internal combustion engines.  A switch to low carbon transportation would cut emissions dramatically, potentially giving a fleet of zero-emission vehicles.\r\rAs the lifetime of an average passenger vehicle is around a decade, low carbon vehicles could be introduced over relatively short periods. Electric vehicles and also some types of hydrogen vehicles have existed for many years, but so far their uptake has been very small. Recently some countries (for example, Norway) have introduced significant incentive systems to support the uptake of low emission vehicles.\r\rCar manufactures are investing in low emission vehicles. After the big success of hybrid engines (combining a combustion engine and an electric motor for energy recovery), Toyota moved on to hydrogen engines and will launch its first purely hydrogen-powered car in 2015. On the forefront of electro engines are companies such as Tesla and BMW.\r\rThe penetration of electric and hydrogen vehicles will depend on technological developments and whether they are seen as affordable and desirable by consumers, public transport providers and freight companies."), detailed_lever_guides_v14(), "'Detailed lever guides'!V14");
  assert_equal(EXCEL_STRING("The impact of the “electric and hydrogen” lever will depend on how the electricity or hydrogen used to power these vehicles is generated (this is taken into account in the Calculator).  The impact of the lever will also be affected by the level of transport demand in the user’s pathway.\r\rMany proponents of low emission vehicles also mention positive side-effects such as less pollution in cities as well as quieter streets. However the uptake of low emission vehicles so far has been hampered by high prices, and also insufficient infrastructure available to charge up vehicles. Recently, manufacturers have focused on expanding charging infrastructure for their vehicles. For example, a group of leading car manufacturers have recently agreed on a fast charging standard allowing battery charging to 80% within half an hour – this might help to implement a working charging network. "), detailed_lever_guides_w14(), "'Detailed lever guides'!W14");
  assert_equal(EXCEL_STRING("By 2050 the percentage of hybrid and electric vehicles remains low for passenger cars, and heavy duty vehicles buses and decreases for 2-3 wheelers. Few new technologies are adopted for ships or aeroplanes. \r"), detailed_lever_guides_x14(), "'Detailed lever guides'!X14");
  assert_equal(EXCEL_STRING("By 2050, there is an increased share of new technologies in the vehicle fleet. The percentage of hybrid and electric vehicles increases for passenger cars, buses and 2-3 wheelers. "), detailed_lever_guides_y14(), "'Detailed lever guides'!Y14");
  assert_equal(EXCEL_STRING("By 2050 there is significant adoption of low emission vehicles. The percentage of hybrid, electric and hydrogen vehicles increases for passenger cars, buses, and 2-3 wheelers . In freight, new technologies are only barely starting to be adopted for ships or aeroplanes."), detailed_lever_guides_z14(), "'Detailed lever guides'!Z14");
  assert_equal(EXCEL_STRING("By 2050 there is major deployment of low emission vehicles. The percentage of hybrid, electric and hydrogen vehicles increases dramatically for passenger cars, buses and 2-3 wheelers. In freight, new technologies are starting to be adopted for around 10% of ships and aeroplanes. "), detailed_lever_guides_aa14(), "'Detailed lever guides'!AA14");
  assert_equal(EXCEL_STRING("1 Electric vehicles in Europe: gearing up for a new phase? , McKinsey&Company, 2014"), detailed_lever_guides_ab14(), "'Detailed lever guides'!AB14");
  assert_equal(EXCEL_STRING("This lever controls the global average floor area of an urban residential home and a rural residential home (m2). It also controls the global average floor area per person for non-residential buildings (m2 per person)"), detailed_lever_guides_u15(), "'Detailed lever guides'!U15");
  assert_equal(EXCEL_STRING("The size of a building affects its energy demand, particularly how much energy it takes to heat or cool it. Bigger homes tend to have higher energy demands than smaller homes, so reducing the average size of a home in the future could impact on emission levels.  \r\rIn 2011 the average size of an urban residential home was 92 m2, but this varies hugely from country to country. For example, the average new Australian home is 214 m2, while in Hong Kong it is 45 m2. In general, however, homes in developing countries tend to be smaller than those in developed countries, and rural homes are smaller than urban ones on average.  \r\rThe floor area of non-residential buildings also varies a lot on a per capita basis from country to country. Developing countries tend to have less non-residential floor area per person than developed ones, as this is closely related to the development of the service economy.   \r\rIn the last fifty years, the total floor area of buildings in developed countries has increased significantly, but this growth has slowed in recent years. The fastest growth is now in developing countries. In China the average house size in 1978 was about 30.8 square meters, but in 2012 the average is about 89 square meters.\r"), detailed_lever_guides_v15(), "'Detailed lever guides'!V15");
  assert_equal(EXCEL_STRING("This lever works with “temperature and hot water use”, and “building insulation” to set total heating and cooling demand, which is the biggest source of demand in the buildings sector."), detailed_lever_guides_w15(), "'Detailed lever guides'!W15");
  assert_equal(EXCEL_STRING("In this scenario, the worldwide average building size increases rapidly from now until 2050, at a rate similar to China today."), detailed_lever_guides_x15(), "'Detailed lever guides'!X15");
  assert_equal(EXCEL_STRING("In this scenario, the worldwide average building size increases at a rate similar to the USA between 1950 and 1970."), detailed_lever_guides_y15(), "'Detailed lever guides'!Y15");
  assert_equal(EXCEL_STRING("This scenario has a growth rate between level 2 and level 4."), detailed_lever_guides_z15(), "'Detailed lever guides'!Z15");
  assert_equal(EXCEL_STRING("In this scenario, the worldwide average building size continues to increase from now until 2050, but at a slower rate than recent years. This is similar to the growth rate in Europe today. "), detailed_lever_guides_aa15(), "'Detailed lever guides'!AA15");
  assert_equal(EXCEL_STRING("This lever controls the average room temperature during warm and cold times of the year. Non-residential, urban and rural residential buildings are modelled separately. The lever also controls hot water demand per person per year for urban and rural populations."), detailed_lever_guides_u16(), "'Detailed lever guides'!U16");
  assert_equal(EXCEL_STRING("Heating and cooling represent a large proportion of total energy demand of buildings (around 50% of demand in OECD countries). \r\rThe energy demand of a building will increase as room temperature moves further away from the outside temperature (i.e. through heating when it is cold outside, or using air conditioning when it is warm outside). By keeping room temperatures closer to the temperature outside, energy demand – and its associated emissions – can decrease greatly.\r\rHistorically, heating and cooling demand has increased in countries as they develop, as people have more money and technology available to spend on achieving a comfortable temperature in their homes and other buildings. For example, in the developed world, the average home temperature in the winter increased over the last few decades, and is now stabilising at around 21deg;C. There is potential for energy demand to grow in developing countries, particularly for cooling as these are concentrated in the warmest parts of the world. \r\rIt is possible to experience the same level of thermal comfort while reducing the average temperature. For example, this can be done by using “smart” heating controls that only heat or cool rooms when they are being used. Smart controls exist in different complexities, ranging from simple clock time systems that switch on the heating system only in mornings and evenings to sophisticated home automation systems. Behaviour change can also make a big difference. During the winter, wearing an extra layer of clothing can compensate for a 1.5deg;C drop in temperature. In Japan, a campaign called Cool Biz encouraged companies to set air conditioners to 28deg;C in offices, and asked workers to wear lighter clothing during the summer (with no jackets and ties). This resulted in significant reduction in electricity demand and emissions. \r"), detailed_lever_guides_v16(), "'Detailed lever guides'!V16");
  assert_equal(EXCEL_STRING("This lever works with the “building size”, and “building insulation” levers to set total heating and cooling demand, which is the biggest source of demand in the buildings sector. The model is based on average room temperatures during the heating season (October to April in the Northern hemisphere), and during the cooling season (May to September in the Northern hemisphere). There are three types of building: urban residential, rural residential, and non-residential."), detailed_lever_guides_w16(), "'Detailed lever guides'!W16");
  assert_equal(EXCEL_STRING("In this scenario, demand has grown and the global average heating season temperature is similar to wealthy households in Beijing by 2050. The average cooling season temperature and hot water demand is similar to that of the USA today. "), detailed_lever_guides_x16(), "'Detailed lever guides'!X16");
  assert_equal(EXCEL_STRING("This scenario is set between level 2 and level 3. "), detailed_lever_guides_y16(), "'Detailed lever guides'!Y16");
  assert_equal(EXCEL_STRING("In this scenario, global average building temperatures are similar to China’s average today. "), detailed_lever_guides_z16(), "'Detailed lever guides'!Z16");
  assert_equal(EXCEL_STRING("In this scenario, the global average heating season temperature for urban homes is lower than 2011 levels. Urban hot water demand is 50% below 2011 levels, and is similar to urban levels in China today."), detailed_lever_guides_aa16(), "'Detailed lever guides'!AA16");
  assert_equal(EXCEL_STRING("This lever controls the average number of appliances per urban and rural household. It also controls average cooking and lighting demand."), detailed_lever_guides_u17(), "'Detailed lever guides'!U17");
  assert_equal(EXCEL_STRING("The appliances modelled for this lever are refrigerators, dishwashers, clothes washers, clothes dryers and TVs. Miscellaneous appliances like laptops and DVD players are modelled separately. It also controls the number of light-bulbs per household, and energy demand for cooking.\r\rEnergy demand from appliances, lighting and cooking has been generally rising as people’s incomes have increased around the world. For example, in the last 20 years, the number of washing machines per household has increased by 32%, dishwashers by 158%, and TVs by 49%.  \r\rIn developed countries, ownership of many large appliances has reached saturation point, but there is a big potential for increases in ownership in developed countries. In countries like India and China, urban homes tend to have considerably more appliances than rural ones.  \r"), detailed_lever_guides_v17(), "'Detailed lever guides'!V17");
  assert_equal(EXCEL_STRING("This lever works with the “temperature, cooking and lighting technology” and “appliance efficiency” to determine the total energy demand and associated emissions from lighting, cooking and appliances in buildings. For example, improvements in energy efficiency over the last 20 years have offset some of the energy demand increases caused by the rise in appliance ownership. \r\rIn all four levels, global average lighting and appliance use levels increase. This allows for growth in demand from developing countries due to increased wealth and electrification (for instance, about 25% of the Indian population had no access to electricity in 2011 according to the World Bank, but are likely to have access by 2050). Even at level 4, all urban households own one refrigerator on average, which is important for food safety.\r\rIn developed countries, there is scope for behaviour shifts to reduce the use of some appliances despite rising incomes (for example, a family could decide they do not need a clothes dryer). The scenarios here could represent a future where there is reduced use in developed countries and increases in developed ones.\r\rCooking demand per household decreases in all four levels because it has been assumed that each household will have fewer occupants in the future due to demographic change. Cooking demand is determined more by the number of people per household than by income. \r"), detailed_lever_guides_w17(), "'Detailed lever guides'!W17");
  assert_equal(EXCEL_STRING("In this scenario, the global average appliance use is similar to the USA and Australia today (an increase of 80%), and has almost reached saturation."), detailed_lever_guides_x17(), "'Detailed lever guides'!X17");
  assert_equal(EXCEL_STRING("In this scenario, the global average appliance use is similar to Germany and France today (an increase of 50%)."), detailed_lever_guides_y17(), "'Detailed lever guides'!Y17");
  assert_equal(EXCEL_STRING("In this scenario, the global average appliance use is similar to the UK and Japan today (an increase of 20%)."), detailed_lever_guides_z17(), "'Detailed lever guides'!Z17");
  assert_equal(EXCEL_STRING("In this scenario, global average appliance use is similar to urban households in China today. This means that the ownership of large appliances in urban areas remains the same on average as today, but the use of small appliances increases.  "), detailed_lever_guides_aa17(), "'Detailed lever guides'!AA17");
  assert_equal(EXCEL_STRING("This lever controls the average rate of heat loss from urban residential, rural residential and non-residential buildings."), detailed_lever_guides_u18(), "'Detailed lever guides'!U18");
  assert_equal(EXCEL_STRING("Space heating and cooling accounts for around 30% of all the energy demand of buildings globally. The amount of energy needed to heat or cool building can be reduced significantly by improving external walls, floors, roofs, ceilings, windows and doors so that the building is better insulated. This means that less heat energy can escape from the inside of the building during cold weather, and less heat energy from outside can get in if you are cooling it.\r\rFor existing buildings, thermal efficiency can be improved by changing windows or adding insulation to walls and roofs. This process is called “retrofitting”. For new buildings, improvements are easier as better materials can be chosen from the outset. Governments can influence this by improving building standards. \r\rThe global average level of insulation has improved over the last few decades. The “passive house” standard has recently been developed and is the best technology available in terms of energy savings. This can reduce heating and cooling demand by 60% with minimal costs (e.g. in Germany, UK and USA the average price for a passive house is on average 5–10% higher than for conventional houses).\r \r"), detailed_lever_guides_v18(), "'Detailed lever guides'!V18");
  assert_equal(EXCEL_STRING("This lever works with the “building size” and “temperature & hot water use” levers to set total heating and cooling demand, which is the biggest source of demand in the buildings sector. \r\rAlthough retrofitting measures and improved materials cost money, these upfront costs can be recouped through significant savings in energy bills for householders. The relatively long payback times of usually more than 10 years for retrofitting are a barrier for building insulation improvements.   \r\rCurrently, buildings in developed countries tend to have higher thermal efficiency than in developing countries, particularly in rural areas. However, building stock in developing countries is growing rapidly, so there is a lot of potential to reduce future energy use here through improvements in insulation. In developed countries, most buildings that will exist in 2050 have already been built.\r"), detailed_lever_guides_w18(), "'Detailed lever guides'!W18");
  assert_equal(EXCEL_STRING("This is a pessimistic scenario in which existing buildings are retrofitted slowly, and standards for new buildings are slow to improve. The current best insulation technologies are rarely used. Overall thermal efficiency of urban residential buildings improves by 20% by 2050. \r\r"), detailed_lever_guides_x18(), "'Detailed lever guides'!X18");
  assert_equal(EXCEL_STRING("In this scenario, insulation continues to improve at a rate similar to that of China over the past 40 years. The overall thermal efficiency of urban residential buildings improves by 40% by 2050. This is what most researchers believe can be achieved (for example the International Energy Agency’s report Transition to Sustainable Buildings). "), detailed_lever_guides_y18(), "'Detailed lever guides'!Y18");
  assert_equal(EXCEL_STRING("In this scenario, the global average insulation in 2050 is similar to that of Europe today. The overall thermal efficiency of urban residential buildings improves by 60% by 2050."), detailed_lever_guides_z18(), "'Detailed lever guides'!Z18");
  assert_equal(EXCEL_STRING("This is the most optimistic scenario, in which the global average for insulation is that of the most advanced houses today. This represents a future where a large proportion of buildings use “passive house” technology. The overall thermal efficiency of urban residential buildings improves by 73% by 2050."), detailed_lever_guides_aa18(), "'Detailed lever guides'!AA18");
  assert_equal(EXCEL_STRING("This lever controls the mix of technologies used for spare heating, space cooling, hot water, cooking and lighting. These are modelled separately for urban residential, rural residential and non-residential buildings."), detailed_lever_guides_u19(), "'Detailed lever guides'!U19");
  assert_equal(EXCEL_STRING("A variety of different technologies are used in buildings for space heating, water heating and cooking. These technologies can have very different efficiencies and emissions associated with them. Today, the most common forms of heating in urban areas are combined heat and power (CHP), district heating, and gas boilers. In rural areas, solid fuel boilers are most common. \r In the future, new technologies could be used which have much lower emissions, for example heat pumps (which use electricity to move latent heat energy from the outside of the building to the inside) and solar hot water systems. This lever allows you to change the proportion of buildings using these new forms, and therefore to reduce emissions. Similarly this lever also increases the proportion of cooling systems that use more efficient and lower carbon technology.  The technologies for space cooling within the model are air conditioning, chillers and solar cooling.\r\rThis lever also allows you to use more electricity in cooking (rather than gas, oil or traditional biomass), and to introduce more efficient lighting options like LED bulbs. \r"), detailed_lever_guides_v19(), "'Detailed lever guides'!V19");
  assert_equal(EXCEL_STRING("The impact of this lever will change depending on how much demand there is for heating (which is determined by “building size”, “temperature & hot water use” and “building insulation”). \r\rNote that electrifying heating and cooking will only result in a reduction in emissions if choices have been made in the Global Calculator to decarbonise the electricity system. \r"), detailed_lever_guides_w19(), "'Detailed lever guides'!W19");
  assert_equal(EXCEL_STRING("In this scenario, the space and water heating mix stays the same as today, and lower carbon options for cooling, cooking and lighting increase only slightly. "), detailed_lever_guides_x19(), "'Detailed lever guides'!X19");
  assert_equal(EXCEL_STRING("There is a shift towards lower carbon technologies. In heating, the use of district heating increases from 17% of urban homes to 55% in 2050.  "), detailed_lever_guides_y19(), "'Detailed lever guides'!Y19");
  assert_equal(EXCEL_STRING("There is a significant shift towards lower carbon technologies."), detailed_lever_guides_z19(), "'Detailed lever guides'!Z19");
  assert_equal(EXCEL_STRING("In this scenario, low-carbon technologies have become the norm for heating and lighting. 50% of all urban homes have heat pumps. "), detailed_lever_guides_aa19(), "'Detailed lever guides'!AA19");
  assert_equal(EXCEL_STRING("This lever controls the average rate of energy use for appliances in urban and rural homes. It also controls the average rate of energy use for equipment in non-residential buildings, and the average efficiency of heating technologies."), detailed_lever_guides_u20(), "'Detailed lever guides'!U20");
  assert_equal(EXCEL_STRING("Appliances have become much more efficient in the last few decades, which means they use less electricity to do the same job. The European Environment Agency has found that the overall efficiency of appliances increased 27% between 1990 and 2009, or around 1.7% per year. Further increases in energy efficiency could lower the emissions impact of increased appliance ownership as living standards improve around the world."), detailed_lever_guides_v20(), "'Detailed lever guides'!V20");
  assert_equal(EXCEL_STRING("This lever works in conjunction with “lighting, cooking & appliance use” to determine the total energy demand for appliances, and therefore the emissions associated with it.  The appliances modelled are refrigerators, dishwashers, clothes washers, clothes dryers and TVs. Miscellaneous appliances like laptops and DVD players are modelled separately.\r\rDespite continued improvements in energy efficiency, the amount of electricity being used on appliances in homes still increased globally between 2000 and 2010.   This is because of the growth in appliance ownership around the world (with a particular surge in the use of electronics and computers), but also because of changes in consumer preference. Many of the efficiency gains have been offset by people choosing larger appliances or ones with more functionality. For example, flat-screen TVs use less energy than cathode ray tube ones, but now households have more TVs per household with larger screens than before. \r\rAs well as technological developments, policy can have a big impact on the average efficiency of appliances by encouraging manufacturers to improve their products and encourage consumers to buy more efficient ones. Some countries have legally enforced standards so that all appliances sold must meet a certain level of efficiency. Labelling schemes (for example the EnergyGuide scheme in the USA) can also help consumers make better choices, as they are able to easily compare the energy usage of different products. In China, the government has subsidised the purchase of new appliances for people in rural areas, greatly improving average efficiency.\r"), detailed_lever_guides_w20(), "'Detailed lever guides'!W20");
  assert_equal(EXCEL_STRING("This scenario represents “business as usual”, with no further improvements in the efficiency of new appliances. Average efficiency increases, however, as people replace their old appliances for new ones. Overall efficiency increases at half the rate seen in Europe over the last 20 years. "), detailed_lever_guides_x20(), "'Detailed lever guides'!X20");
  assert_equal(EXCEL_STRING("This scenario is set between levels 1 and 3, and represents moderately ambitious effort to roll out energy efficiency measures. "), detailed_lever_guides_y20(), "'Detailed lever guides'!Y20");
  assert_equal(EXCEL_STRING("In this scenario, the rates of efficiency improvement seen in Europe in the last 20 years are sustained globally until 2050. This represents high effort on energy efficiency, which could be driven by regulation, costs, or demand from consumers for more efficient products."), detailed_lever_guides_z20(), "'Detailed lever guides'!Z20");
  assert_equal(EXCEL_STRING("In this scenario, the energy efficiency of appliances increases at a faster rate than that seen in the last 20 years. This represents the most optimistic scenario, in which policy and technological change are taken up all over the world."), detailed_lever_guides_aa20(), "'Detailed lever guides'!AA20");
  assert_equal(EXCEL_STRING("The lever controls the lifespan of products, including vehicles and domestic appliances. It also controls whether product demand will increase for paper products. Note however that the demand for products required by activity in the other sectors (buildings, infrastructure, transport & energy) is defined by other levers. For example when demand for car transport increases, we assume an increase in car manufacturing."), detailed_lever_guides_u21(), "'Detailed lever guides'!U21");
  assert_equal(EXCEL_STRING("If products had longer lifetimes, they would be replaced less often, meaning fewer new products would be manufactured each year. This would mean less energy and lower industrial emissions.\r\rFor high energy-using products such as cars and trains, there is a trade-off between extending product lifetimes (to reduce manufacturing emissions), or upgrading and replacing products to reduce annual energy usage. This is particularly significant when efficiency of new products may be improving quickly each year.\r\rWhile the optimal replacement rates for energy and emission reductions will vary for different products, research estimated that people currently replace objects much more frequently than we would if our objective were to minimise energy inputs. There is therefore significant potential to save energy and emissions by extending the product lifespans. \r\rAs well as increasing product lifespan, global emissions and energy consumption could be reduced by reducing global consumption of products. Currently consumption of products is correlated to GDP, therefore as the economies of developing countries expand, it is expected that consumption of goods will increase. "), detailed_lever_guides_v21(), "'Detailed lever guides'!V21");
  assert_equal(EXCEL_STRING("There are several ways to increase the lifetime of products. Firstly, if products were made more durable, they could last longer before becoming degraded and no longer fit for use. For example, by heat-treating rail tracks, we could significantly increase wear resistance, and this has been shown to extend track life and hence reduce rail emissions by up to 50%. Products could be designed in a way that makes future upgrades much easier, allowing the product to keep pace with new designs (or fashion) without full replacement. Alternatively, when products are no longer required by one owner, more could be given or sold to new owners, rather than being thrown away. \r\rAs people get wealthier, they tend to consume more. However, if our global consumption pattern moved to consuming more service-based products (e.g. visiting spas, rather than going shopping), or more products that are less resource intensive (e.g. music and films in electronic form, rather than CDs and DVDs), it may be possible to partially decouple increased consumption from GDP growth and wellbeing, and hence reduce consumption of products per person by 2050.\r\rWithin the model, product demand is defined by other levers whenever possible. Some examples are:\r- Windmills & Solar PV demand are influenced by the “wind” and “solar” levers;\r- Buildings demand is influenced by “building size” lever;\r- Appliances demand is influenced by the “lighting and appliance use” lever;\r- Infrastructure demand is influenced by “passenger distance” lever;\r- Car, train & bus demand is influenced by the “transport mode” and “car ownership” levers;\r- Fertilizer demand is influenced by the agriculture “crop yields” lever.\rMost products are influenced by several levers and nearly all are influenced by the population."), detailed_lever_guides_w21(), "'Detailed lever guides'!W21");
  assert_equal(EXCEL_STRING("There is no development in product reuse or recycling, hence product lifespans are similar to those in 2011."), detailed_lever_guides_x21(), "'Detailed lever guides'!X21");
  assert_equal(EXCEL_STRING("There is moderate development in product reuse and recycling, hence product lifespans increase in comparison to those in 2011."), detailed_lever_guides_y21(), "'Detailed lever guides'!Y21");
  assert_equal(EXCEL_STRING("There is significant development in product reuse and recycling, hence product lifespans increase in comparison to those in 2011."), detailed_lever_guides_z21(), "'Detailed lever guides'!Z21");
  assert_equal(EXCEL_STRING("There is highly significant development in product reuse and recycling, hence product lifespans increase in comparison to those in 2011."), detailed_lever_guides_aa21(), "'Detailed lever guides'!AA21");
  assert_equal(EXCEL_STRING("1 Allwood and Cullen, 2012. Sustainable Materials with Both Eyes Open. UIT Cambridge."), detailed_lever_guides_ab21(), "'Detailed lever guides'!AB21");
  assert_equal(EXCEL_STRING("This lever controls the amount of material required to produce a given product in 2050, in comparison to 2011. It also controls material switching to use less CO2-intensive materials to manufacture goods, and the proportion of products that are recycled in 2050."), detailed_lever_guides_u22(), "'Detailed lever guides'!U22");
  assert_equal(EXCEL_STRING("The carbon emissions and energy input associated with products, such as televisions (TVs) and cars, can be reduced in broadly three different ways. Firstly, design improvements, so that less material is required during product manufacture. Secondly, material switching, which involves either using less carbon-intensive materials for product manufacture, or making products from materials which improve the design of the product, therefore resulting in lower emissions from the use of the product during its lifespan. Thirdly, using more recycled materials can reduce energy and emissions.\r\rAllwood and Cullen (2012) estimated that by optimising product designs, we could use approximately 30% less metal per product globally, without affecting product quality. They also predicted that there would be potential to recycle 90% of steel and aluminium globally by optimising systems to maximise scrap collection and separation. There are similar opportunities to reduce the use of other virgin materials by design and increased re-use and recycling. "), detailed_lever_guides_v22(), "'Detailed lever guides'!V22");
  assert_equal(EXCEL_STRING("Better design\rBy designing products with a specification to minimise material requirements, significant material savings could be achieved without compromising the technical requirements of the product. Examples of design improvements could be lighter steel and aluminium products (e.g. vehicles), buildings built with minimal structural steel, plastic products that are stronger and lighter than present, and optimising cement strengths.\rMaterial savings can also be achieved by improving manufacturing processes, so that less scrap is produced, and less material is required to make the same products. Currently, nearly half of all aluminium is converted into scrap rather than products in manufacturing processes.\r\rMaterial switching\rSwitching product materials to materials with lower greenhouse gas intensities could also reduce emissions from the manufacturing of goods. For example, cars and trucks could be manufactured in part from aluminium or carbon fibre rather than steel, planes could be made using carbon fibre, rather than aluminium, reducing their weight, or building structures could be made from timber rather than steel, to reduce the emission intensity of manufacture.\rIn the Global Calculator, material switching from steel to timber, steel to aluminium, steel to plastics, cement to timber, and cement to plastics are considered. However material substitution is highly complex, and there are other potential substitutions that are currently not modelled here.\rIt is important to note that there could be some disadvantages associated with the material switches modelled here: \r• Wood burns more easily and is less stable than steel and concrete. More wood is also required than metal to produce a product of considerable strength, however some of these limitations are now being addressed with new technologies such as cross lamination. \r• Timber can act as a ‘carbon sink’, with carbon from the atmosphere being stored in products. However, increasing timber demand could impact biodiversity, and the carbon stored in forests. Please refer to the land and food sector for the impacts of biomass.\r• Aluminium has significantly higher embodied energy and emissions associated with it than steel; however, it weighs much less than steel, so if used in vehicles the saving in weight can result in reduced fuel consumption. This leads to a trade-off between the up-front manufacturing energy for vehicles, and the energy used during a vehicle’s life-time.  \r\rRecycling\rFor steel, most recycled metals are currently produced from scrap generated during production, rather than post-consumer scrap; these wastes are generally well sorted, aiding recycling. However, post-consumer scrap is forecast to increase, therefore separation will become critical and to maximise metals recycling new technologies may be required, for example, to remove copper from recycled steel. Future aluminium recycling rates are expected to decrease, mainly because the availability of aluminium scrap is forecast to be limited in the future. Carbon fibre products are difficult to recycle.\rIt is currently very energy intensive to recycle concrete materials, therefore this is seldom practiced. However, concrete re-use may be more common in the future, particularly if more concrete components are made in standardised units.\rPaper is already widely recycled, with around 60% of all paper being recycled in Europe and North America. The rate of paper recycling has been increasing steadily over the past decade, and it is projected that this trend will increase as less developed countries start to recycle more in the future.\r\rIf you have chosen a high level for this lever, the improvements in design could also translate into higher vehicle efficiency, so you may want to consider choosing a high level for the ‘Transport Efficiency’ lever as well.\rTo ensure your scenario is consistent, we recommend setting “Iron, Steel and Aluminium lever” to the same value as this lever (Design, Materials and Recycling). This is because the chosen amount of recycling of steel defines the technologies used to manufacture steel products."), detailed_lever_guides_w22(), "'Detailed lever guides'!W22");
  assert_equal(EXCEL_STRING("There are very few product and material design improvements between 2011 and 2050. The material demand per product and the level of recycling in 2050 are the same as in 2011, and there is no switch to less carbon-intensive materials."), detailed_lever_guides_x22(), "'Detailed lever guides'!X22");
  assert_equal(EXCEL_STRING("There are ambitious product and material design improvements between 2011 and 2050, resulting in a reduced requirement for material per product. There are also minor switches to using less carbon-intensive materials and a small increase in recycling levels."), detailed_lever_guides_y22(), "'Detailed lever guides'!Y22");
  assert_equal(EXCEL_STRING("There are very ambitious product and material design improvements between 2011 and 2050, resulting in a significantly reduced requirement for material per product. There are also significant switches to using less carbon-intensive materials and a significant increase in recycling levels."), detailed_lever_guides_z22(), "'Detailed lever guides'!Z22");
  assert_equal(EXCEL_STRING("There are extremely ambitious product and material design improvements between 2011 and 2050, resulting in a much reduced requirement for material per product. There are also major switches to less carbon-intensive materials, and a major increase in recycling levels."), detailed_lever_guides_aa22(), "'Detailed lever guides'!AA22");
  assert_equal(EXCEL_STRING("1 Allwood and Cullen, 2012. Sustainable Materials with Both Eyes Open. UIT Cambridge."), detailed_lever_guides_ab22(), "'Detailed lever guides'!AB22");
  assert_equal(EXCEL_STRING("This lever controls the global average greenhouse gas emission intensities associated with iron, steel and aluminium production. These are affected by the choice of the manufacturing processes, the fuels used in the processes and the efficiency of the processes."), detailed_lever_guides_u23(), "'Detailed lever guides'!U23");
  assert_equal(EXCEL_STRING("For thousands of years, iron has been used to make products required for human use, such as tools. Today, steel, iron and aluminium are used to make many products, including cars, ships, electrical equipment, electrical equipment, buildings, domestic appliances and consumer packaging.\r\rIn the future, metal manufacturing processes could become more energy-efficient as technology advances, resulting in fewer emissions being released per tonne of metal manufactured. For example, currently the majority of steel is manufactured using traditional blast oxygen furnaces (71% in 2011) and electric arc furnaces (24% in 2011), but the steel industry is exploring several new technologies (e.g. Hisarna and electric arc Direct Reduced Iron), which could reduce the energy requirements of the process. These technologies can process different amounts of scrap; in the Global Calculator it is assumed that traditional blast furnaces can process 11% to 40% scrap, electric arc 100% scrap, HIsarna 0 to 30% scrap, and Electric arc Direct Reduced Iron 66% to 70%. See below for more detail on these technologies.\r\rEmissions per tonne of metal could also be reduced by using lower-carbon fuels to power the manufacturing processes. This could be achieved by (i) substituting the fuel used in the process for less carbon intensive fuel such as biomass, natural gas and hydrogen, (ii) using Combined Heat and Power (CHP) to provide the energy needs of the process, and (iii) capturing the carbon generated during the process to prevent its release to the atmosphere. "), detailed_lever_guides_v23(), "'Detailed lever guides'!V23");
  assert_equal(EXCEL_STRING("The emissions mentioned in this sector do not include those from electricity generation, to avoid double counting with the supply sector emissions.\r\rThe amount of biomass that is required as a fuel for iron, steel and aluminium production is accounted for in the calculations for the supply of biomass. In the Global Calculator, the maximum amount of biomass required for manufacturing is therefore determined, and then assessed against the biomass supply determined by other levers to determine the amount of fossil fuels that are substituted by biomass.\r\rIn order to have a consistent scenario, this lever (Iron, Steel and Aluminium) must be aligned with the Design, Materials and Recycling lever. This is because the chosen amount of recycling of steel defines the technologies used to manufacture steel products. \r\rAllwood and Cullen (2012) studied the potential for future innovative technologies to save energy and reduce emissions in future; they concluded that no currently developed methods offer a ‘step change’ in energy efficiency of manufacturing processes, and none were close to mass exploitation in 2012. Some of the potential innovative technologies are discussed below.\rToday, traditional blast furnaces are used to produce steel. Fuel (often coke), iron ore and limestone are supplied to the furnace, along with a blast of air at 900 – 1,300˚C, causing chemical reactions to produce ‘pig iron’. Pig iron pellets are then converted to primary steel using the Bessemer process, where oxygen is blown through the molten pig iron. More energy-efficient technologies for producing primary steel exist, and may become more prevalent in the future; for example, the HIsarna process can produce steel from molten pig iron directly from a specially-designed furnace, without having to convert the pig iron into pellets first; this simplifies the process and reduces the energy requirements.\r\rSecondary (recycled) steel is currently manufactured in electric arc furnaces, using electricity to generate the energy required to melt the used steel. Electric arc processes can also be used to make primary steel by feeding the electric arc furnace with direct reduced iron (DRI). Here iron ore is first converted to DRI in a gas-fuelled furnace at temperatures of 800 – 1,000˚C, before being converted to steel in conventional electric arc furnaces. As this process does not use coke, the emissions are lower than traditional steel manufacture.\r\rPrimary aluminium is manufactured by the electrolysis of alumina in molten cryolite (the Hall-Heroult process), and therefore the process emission intensity depends on the emission intensity of the electricity, and the amount of electricity required by the process. Industry has been investigating ways to reduce the electricity consumption of the Hall-Heroult process for several decades.\r\rAnother way to improve efficiency is by using combined heat and power (CHP) energy generation to power the process, where heat that is produced during electricity generation is used to meet process heat demands. Recently, CHP has been adapted more widely by industry.\r\rCarbon capture & storage technology could also help to reduce emissions. This is addressed by the lever “manufacturing CCS”."), detailed_lever_guides_w23(), "'Detailed lever guides'!W23");
  assert_equal(EXCEL_STRING("Continued use of current processes and technologies, and current fuels, resulting in minimal improvements in energy efficiency. Emissions per tonne of steel and aluminium are unchanged by 2050."), detailed_lever_guides_x23(), "'Detailed lever guides'!X23");
  assert_equal(EXCEL_STRING("Moderate process and technology changes to more efficient production processes (e.g. switch to HIsarna and DRI electric arc for steel). Some fuel switches in blast oxygen furnaces (e.g. coal fuel replaced by hydrogen, natural gas, and biomass), and in primary aluminium production (coal fuel replaced by biomass). Some energy efficiency improvements."), detailed_lever_guides_y23(), "'Detailed lever guides'!Y23");
  assert_equal(EXCEL_STRING("Significant process and technology changes to more efficient production processes (such as switch to HIsarna and DRI electric arc for steel). Important fuel switches in blast oxygen furnaces (e.g. some coal fuel replaced by hydrogen, natural gas, and biomass), and in primary aluminium production (some coal replaced by biomass). Significant energy efficiency improvements. "), detailed_lever_guides_z23(), "'Detailed lever guides'!Z23");
  assert_equal(EXCEL_STRING("Extreme process and technology changes to more efficient production processes (such as switch to HIsarna and DRI electric arc for steel). Major fuel switches in blast oxygen furnaces (e.g. some coal fuel replaced by hydrogen, natural gas, and biomass), and in primary aluminium production (some coal replaced by biomass). Energy efficiency improvements close to technical and physical constraints."), detailed_lever_guides_aa23(), "'Detailed lever guides'!AA23");
  assert_equal(EXCEL_STRING("1 Allwood and Cullen, 2012. Sustainable Materials with Both Eyes Open. UIT Cambridge.\r2 Our cross sector consultation document contains more background and references."), detailed_lever_guides_ab23(), "'Detailed lever guides'!AB23");
  assert_equal(EXCEL_STRING("This lever controls the global average greenhouse gas emission intensity associated with chemical production. This is affected by the choice of the manufacturing processes, the fuels used in the processes, and the efficiency of the processes."), detailed_lever_guides_u24(), "'Detailed lever guides'!U24");
  assert_equal(EXCEL_STRING("The chemicals sector is very diverse, producing a broad range of materials with many different compositions, treatments and properties. In the global calculator the following main groups have been considered:\r• High Value Chemicals (HVC) which consists of plastics such as propylene, PVC and ethylene;\r• ammonia, used in fertilisers to increase agricultural productivity, and also for pharmaceuticals and cleaning products;\r• methanol, used to produce formaldehyde (part of products as diverse as plastics, plywood, paints, explosives, and permanent press textiles); \r• any other chemicals.\r\rThe energy and emission intensity of chemical production could be reduced by process and energy efficiency improvements. For example, using Combined Heat and Power (CHP) to generate the energy required for the processes, then capturing and storing the carbon emissions from the processes to prevent their release to the atmosphere (known as Carbon Capture and Storage, or CCS). \r"), detailed_lever_guides_v24(), "'Detailed lever guides'!V24");
  assert_equal(EXCEL_STRING("The IEA suggests that with best practice technologies, process improvements, CHP, recycling and energy recovery, over 13 EJ could be saved globally from chemical production, compared to current production methods. The largest share in energy savings (about 5 EJ) could be achieved by employing best practice technologies for providing process heat. Compared to the current energy use of the global chemical and petrochemical industry, this potential translates to around 35% energy savings, whilst carbon emissions could be reduced by about 20-35%.  \rThere is also significant potential to reduce both the upstream emissions associated with chemicals, by better design and recycling of chemical products, and the downstream emissions, by using CCS. These emission reduction potentials are addressed by other levers: “Design, Materials and Recycling” and “CCS (manufacturing)”.\r\rThe majority of those energy savings measures should enhance the market competitiveness of chemical companies; however, there are several barriers to the adaptation of energy efficient technologies. Corporate policy often restricts investments with payback times longer than a few years; financial constraints are particularly important for small and medium size companies, especially in the developing world. Furthermore, decision makers are sometimes not aware of all energy efficient technologies, and even if they are, there might be different prioritisations to energy efficiency in the company.\r\rThe emissions mentioned in this sector do not include electricity, to avoid double counting with supply sector emissions. In the Global Calculator, the amount of biomass that is required as a fuel for the chemical production processes is accounted for in the calculations for the supply of biomass. The maximum amount of biomass required for chemical production is therefore calculated, and then assessed against the biomass supply determined by other levers to work out the amount of fossil fuels that are substituted by biomass."), detailed_lever_guides_w24(), "'Detailed lever guides'!W24");
  assert_equal(EXCEL_STRING("Continued use of current processes and technologies. Continued use of fossil fuels. Minimal improvements in energy efficiency. 5% of the electricity used in chemical processes is generated by CHP processes."), detailed_lever_guides_x24(), "'Detailed lever guides'!X24");
  assert_equal(EXCEL_STRING("Some fuel changes, e.g. 10% of coal energy replaced by natural gas for HVC production, and 5% of coal energy replaced by biomass for all chemical production. 10% of the electricity used in chemical processes is generated by CHP processes."), detailed_lever_guides_y24(), "'Detailed lever guides'!Y24");
  assert_equal(EXCEL_STRING("Significant fuel changes, e.g. 20% of coal energy replaced by natural gas for HVC production, and 10% of coal energy replaced by biomass for all chemical production. 15% of the electricity used in chemical processes is generated by CHP processes."), detailed_lever_guides_z24(), "'Detailed lever guides'!Z24");
  assert_equal(EXCEL_STRING("Extreme fuel changes, e.g. 30% of coal energy replaced by natural gas for HVC production, and 20% of coal energy replaced by biomass for all chemical production. 20% of the electricity used in chemical processes is generated by CHP processes."), detailed_lever_guides_aa24(), "'Detailed lever guides'!AA24");
  assert_equal(EXCEL_STRING("1 Principles for Global Policies to Reduce Greenhouse Gas Emissions, The Chemical Industry and Climate Change, International Council of Chemical Associations, 2009.\r2 Innovations for Greenhouse Gas Reductions, A life cycle quantification of carbon abatement solutions enabled by the chemical industry, International Council of Chemical Associations, 2009.\r3 Energy Technology Perspective 2014, IEA.\r4 Chemical and Petrochemical Sector Potential of best practice technology and other measures for improving energy efficiency, IEA information paper, 2009.\r5 Understanding the challenges and opportunities for\u2028the chemical sector, European Climate Foundation, 2014."), detailed_lever_guides_ab24(), "'Detailed lever guides'!AB24");
  assert_equal(EXCEL_STRING("This lever controls the global average greenhouse gas emission intensities associated with paper products, timber products and products of other manufacturing industries (lime, glass, non-ferrous metals, ceramics, textiles and food & beverages processing).\rEmissions and energy use are affected by the choice of the manufacturing processes, the fuels used in the processes, and the efficiency of the processes."), detailed_lever_guides_u25(), "'Detailed lever guides'!U25");
  assert_equal(EXCEL_STRING("Paper is a natural material produced from pulp, and is used for a wide array of applications such as writing and office paper, hygiene and packaging. Although many types of fibre can be used for paper production, wood fibres are the main feedstock (other types of fibres have not been assessed in the scope of this calculator).\r\rAfter the introduction of modern workstation computers in the 1980s, some predicted a decline in the paper industry; however, paper demand has continued to grow. Annual global paper demand was 363 Mt per year in 2005. By 2050, the global paper demand is expected to be 2.4 times higher still.\r\rIn 2011, the global average emission intensity of pulp & paper production was 0.65 tCO2e per tonne produced (including both virgin and recycled paper). Allwood and Cullen (2012) predicted that the paper industry might be able to reduce emissions by 40% in the future, if all possible best practices in increase energy efficiency were applied, assuming a recycling rate of 80%."), detailed_lever_guides_v25(), "'Detailed lever guides'!V25");
  assert_equal(EXCEL_STRING("Paper can be made either from virgin fibres or from recycled fibres. The proportion of virgin and recycled paper is selected in the lever “design, materials & recycling”. \r\rFor virgin fibres, an average of 24 trees are needed to produce one tonne of writing or printing paper. High demand for wood products, such as paper, has resulted in deforestation in the past, as well as the conversion of natural forest to industrial plantations, with negative implications for stored carbon and biodiversity. Given that fibre recycling is less energy intensive and consumes less biomass than using virgin wood for paper production, paper recycling provides an eco-friendly solution to this problem if the usage of harmful chemicals is avoided. From 1991 to 2009, paper-recycling rates in the EU and North America increased from around 40% to over 60%, and this trend is continuing. \r\rSeveral process and energy efficiency improvements are possible in the paper industry. For example, the drying step is typically very energy intensive and could be re-engineered to reduce energy requirements. Fuel switches could also reduce emissions, for example, by using biomass co-products and by-products such as black liquor to provide energy for the process, rather than coal. Such fuel switches could be combined with carbon capture and storage (CCS) in the future to reduce emissions. In the global calculator, the application of CCS technologies can be regulated with the lever “CCS (manufacturing)”. Finally, Combined Heat and Power (CHP) technologies could be used to provide process heat and electricity requirements in a more efficient manner in the future.\r\rThe amount of biomass that is required as a fuel for paper and other manufacturing is accounted for in the calculations for the supply of biomass. In the Global Calculator, the maximum amount of biomass required for manufacturing is therefore determined, and then assessed against the biomass supply determined by other levers to determine the amount of fossil fuels that are substituted by biomass.\r"), detailed_lever_guides_w25(), "'Detailed lever guides'!W25");
  assert_equal(EXCEL_STRING("Continued use of current processes and technologies. Continued use of fuels. Minimal improvements in energy efficiency and additional CHP installations. Carbon dioxide emissions per tonne of virgin and recycled paper in 2050 equal 2011 values."), detailed_lever_guides_x25(), "'Detailed lever guides'!X25");
  assert_equal(EXCEL_STRING("Moderate process and technology changes, improvements in energy efficiency, and use of CHP. Some fuel switches from coal to biomass.  Carbon dioxide emissions per tonne of virgin paper in 2050 are 23% lower than in 2011 value; carbon dioxide emissions per tonne of recycled paper in 2050 are 21% lower than in 2011."), detailed_lever_guides_y25(), "'Detailed lever guides'!Y25");
  assert_equal(EXCEL_STRING("Significant process and technology changes, improvements in energy efficiency, and use of CHP. Significant fuel switches from coal to biomass. Carbon dioxide emissions per tonne of virgin paper in 2050 are 35% lower than in 2011; Carbon dioxide emissions per tonne of recycled paper in 2050 are 33% lower than in 2011."), detailed_lever_guides_z25(), "'Detailed lever guides'!Z25");
  assert_equal(EXCEL_STRING("Extreme process and technology changes, improvements in energy efficiency, and use of CHP. Major fuel switches from coal to biomass. Carbon dioxide emissions per tonne of virgin paper in 2050 are 50% lower than in 2011; carbon dioxide emissions per tonne of recycled paper in 2050 are 47% lower than in 2011."), detailed_lever_guides_aa25(), "'Detailed lever guides'!AA25");
  assert_equal(EXCEL_STRING("1 Allwood and Cullen, 2012. Sustainable Materials with Both Eyes Open. UIT Cambridge."), detailed_lever_guides_ab25(), "'Detailed lever guides'!AB25");
  assert_equal(EXCEL_STRING("This lever controls the global average greenhouse gas emission intensity associated with cement production. This is affected by the choice of the manufacturing process, the fuels used in the processes, and the efficiency of the processes."), detailed_lever_guides_u26(), "'Detailed lever guides'!U26");
  assert_equal(EXCEL_STRING("Cement is one of the main components of concrete, binding stones tightly together so that it can be used to build buildings. While cement had been known since Roman times (e.g. the Pantheon in Rome was build with it), concrete became enormously popular in the 20th century due to famous architects such as Le Corbusier who appreciated concrete as a relatively cheap and versatile material. \r\rCurrent annual global cement production is 2.8 Gt, which could produce 23 Gt of concrete; 40% of this cement is produced in China. Cement production is growing fast, and the Global Calculator can model cement production ranging from 3.3 to 8.7 Gt by 2050.\r\rCement production involves a number of reactions, with the principal reaction being the decomposition of limestone into lime and carbon dioxide. Half of the CO2 emissions associated with the production of cement are released in this reaction – another 40% are emitted from burning fuel to power the process. There are several ways to reduce cement energy inputs and emissions, including (i) substituting clinker for other materials, (ii) substituting the fuel used in the process for less carbon intensive fuel, and (iii) capturing the carbon generated during the process to prevent its release to the atmosphere."), detailed_lever_guides_v26(), "'Detailed lever guides'!V26");
  assert_equal(EXCEL_STRING("In cement production, the most energy and emission intensive part of the process is the production of clinker. Therefore, to reduce energy inputs and emissions associated with cement, this clinker can be partially substituted by other materials (for example, ground granulated blast furnace slag or pulverised fly ash) that are by-products of other products or arise naturally. Substitution rates as high as 90% are possible for most applications. This ‘composed’ cement can be more resistant to compression, but it often takes longer to dry, implying higher storage costs.\r \rAnother way to reduce emissions is fuel substitution. In Europe it is common to burn waste material, such as old tyres and municipal solid waste, instead of fossil fuels; the presence of limestone in the process is known to clean the exhaust gas, allowing the use of such waste as fuel. \r\rToday, the best practice production has an energy need of 2.9 GJ per tonne of cement, whereas the theoretical minimum is 1.8 GJ/tonne. Thus, we cannot expect much technology improvement beyond current best practice. The global average lies today at 4.7 – 5.5 GJ/tonne, almost twice as high as best practice1. This is mainly due to small factories in China and India using old production technology; in particular, heat recovery systems are missing. The global energy use is expected to decrease rapidly as these older plants are being replaced in China.\r\rCarbon capture & storage technology could also help to reduce emissions. This is addressed by the lever “Carbon capture and storage (ind.)”.\r\rThe emissions mentioned in this sector do not include electricity, to avoid double counting with supply sector emissions.\r\rThe amount of biomass needed as fuel for the cement process is accounted for in the calculations for the supply of biomass. In the Global Calculator, the maximum amount of biomass required for cement production is therefore calculated, and then assessed against the biomass supply determined by other levers to determine the amount of fossil fuels that are substituted by biomass."), detailed_lever_guides_w26(), "'Detailed lever guides'!W26");
  assert_equal(EXCEL_STRING("Continued use of current processes and technologies and use of fuels. Minimal improvements in energy efficiency."), detailed_lever_guides_x26(), "'Detailed lever guides'!X26");
  assert_equal(EXCEL_STRING("Moderate process and technology changes. Some fuel switch from coal to biomass, and improvements in process energy efficiency."), detailed_lever_guides_y26(), "'Detailed lever guides'!Y26");
  assert_equal(EXCEL_STRING("Significant process and technology changes. Significant fuel switch from coal to biomass, and improvements in process energy efficiency."), detailed_lever_guides_z26(), "'Detailed lever guides'!Z26");
  assert_equal(EXCEL_STRING("Extreme process and technology changes. Major fuel switch from coal to biomass, and improvements in process energy efficiency close to technical and physical constraints."), detailed_lever_guides_aa26(), "'Detailed lever guides'!AA26");
  assert_equal(EXCEL_STRING("1 Allwood and Cullen, 2012. Sustainable Materials with Both Eyes Open. UIT Cambridge.\r2 Our cross sector consultation document contains more background and references"), detailed_lever_guides_ab26(), "'Detailed lever guides'!AB26");
  assert_equal(EXCEL_STRING("This lever controls the proportion of process and combustion emissions that are captured by CCS processes in the future. CCS is not implemented in industry in 2011."), detailed_lever_guides_u27(), "'Detailed lever guides'!U27");
  assert_equal(EXCEL_STRING("Currently, industrial processes generate approximately 27% of all global emissions. These emissions are from a diverse range of sources, including the combustion of fossil fuels to provide process energy, and emissions from chemical reactions (e.g. cement production). Currently all these emissions are released into the atmosphere; however, in the future, the CO2 could be captured at the industrial plant, transported  by pipelines and then pumped into deep underground structures, such as depleted oil and gas reserves, so that it is not released into the atmosphere. "), detailed_lever_guides_v27(), "'Detailed lever guides'!V27");
  assert_equal(EXCEL_STRING("The big advantage of using CCS technologies to capture and store CO2 from industrial processes is that the emission intensity of materials, such as cement and steel, can be reduced significantly. However, it takes energy to capture CO2 and pump it underground, and therefore including CCS facilities into industrial processes would increase the overall global demand for energy; in the Global Calculator it has been assumed that for each Giga-tonne of CO2 captured, approximately 1 EJ of electricity would be required. \r\rSimilar CCS technologies can be used in industrial processes and in power stations; however, industrial plants often have many different sources of CO2, whereas power plants generally have only one major source (the boiler). Some of the CO2 sources from industrial processes are likely to be easier to capture than others, therefore CCS technologies would need to be applied carefully to maximise the cost-effectiveness of reducing CO2 emissions.\r\rCurrently CCS technologies are unproven, and there are worries that the technology may not be commercially viable in the future owing to the high costs involved. However, significant research is underway to improve the performance of CCS technologies and hence reduce the costs, for example, by reducing the energy requirements of separating and storing the CO2."), detailed_lever_guides_w27(), "'Detailed lever guides'!W27");
  assert_equal(EXCEL_STRING("No CCS development."), detailed_lever_guides_x27(), "'Detailed lever guides'!X27");
  assert_equal(EXCEL_STRING("Increased CCS usage from 2030 onwards."), detailed_lever_guides_y27(), "'Detailed lever guides'!Y27");
  assert_equal(EXCEL_STRING("Significant CCS usage from 2030 onwards."), detailed_lever_guides_z27(), "'Detailed lever guides'!Z27");
  assert_equal(EXCEL_STRING("Extreme CCS usage from 2030 onwards."), detailed_lever_guides_aa27(), "'Detailed lever guides'!AA27");
  assert_equal(EXCEL_STRING("1 Leeson, D., Fairclough, J., Petit, C. and Fennell, P. 2014. A Systematic Review of Current Technology and Cost for Industrial Carbon Capture."), detailed_lever_guides_ab27(), "'Detailed lever guides'!AB27");
  assert_equal(EXCEL_STRING("This lever controls the proportions of solid, liquid or gaseous fuel used in thermal electricity generation. “Liquid” hydrocarbon is oil and “gaseous” is natural gas. “Solid” is coal or, if the user specifies high levels of solid bioenergy in their pathway, this could also be solid biomass. "), detailed_lever_guides_u28(), "'Detailed lever guides'!U28");
  assert_equal(EXCEL_STRING("In a thermal power plant, fossil fuels (or biomass) are burned and converted in electricity using steam turbines. Although designed for continuous operation, fossil fuel power plants can be switched on and off much faster than nuclear power stations, making them a better partner for renewable energy. In 2011, fossil fuels contributed 71% of global electricity supply. Fossil fuels were formed by anaerobic decomposition of organisms (prehistoric plants and animals) that lived hundreds of millions of years ago. Oil is a particularly versatile fuel being used for transport (cars, planes etc.) and electricity generation, as well as for manufacturing products like plastic. The question is therefore if we want to burn oil or use it for other purposes in the future. The main challenges might be the electrification of transport and replacing aviation fuel with bio fuels.\r"), detailed_lever_guides_v28(), "'Detailed lever guides'!V28");
  assert_equal(EXCEL_STRING("In terms of climate impact, the dirtiest fuels are: firstly coal, secondly oil, and thirdly natural gas. For example, today, lignite (brown coal) is most carbon-intensive, emitting about 100,000 grams of CO2 per Gigajoule (g/GJ) followed by hard coal with 95,000 g/GJ. Oil has around 75,000 g/GJ. The fossil fuel with the lowest climate change impact is natural gas with 56,000 g/GJ. Currently electricity generation from coal is the cheapest because it is about four times more abundant than oil or natural gas. However in the future, carbon taxation and other regulatory means are expected to increase the costs for coal and favour natural gas. The average lifetime of fossil fuel power plants is around 30-50 years. All of them need several decades to recover the costs of their initial investment, so this might hinder the change towards natural gas. Given the long lifespan of thermal power plants, another solution could be the usage of biomass as fuel. If the user selects a high output of solid biomass, the model will automatically allocate some of this to electricity generation if “coal” is selected. The user can generate a high output of solid biomass by: reducing land required for food by reducing food demand or boosting food yields; adjusting the “surplus land (forest and bioenergy)” lever such that surplus land is used for bioenergy; setting “bioenergy yields” high; and setting “solid or liquid” to solid. \r"), detailed_lever_guides_w28(), "'Detailed lever guides'!W28");
  assert_equal(EXCEL_STRING("In 2050, the majority of burned fuel in thermal power plants is still solid (61%) and the contribution of natural gas is reduced.  "), detailed_lever_guides_x28(), "'Detailed lever guides'!X28");
  assert_equal(EXCEL_STRING("In 2050, a higher proportion of liquid (oil) and gaseous fuels (natural gas) are used for energy generation. "), detailed_lever_guides_y28(), "'Detailed lever guides'!Y28");
  assert_equal(EXCEL_STRING("In 2050, the contribution of natural gas to the energy generation is much higher than today (41%) and about equal to solid forms of fossil fuel."), detailed_lever_guides_z28(), "'Detailed lever guides'!Z28");
  assert_equal(EXCEL_STRING("In 2050, over 70% of thermal energy generation from hydrocarbons comes from natural gas."), detailed_lever_guides_aa28(), "'Detailed lever guides'!AA28");
  assert_equal(EXCEL_STRING("1 World Energy Outlook Factsheet, IEA, 2013. Air pollution from electricity-generating large combustion plants, European Environment Agency (EEA), 2008."), detailed_lever_guides_ab28(), "'Detailed lever guides'!AB28");
  assert_equal(EXCEL_STRING("This lever controls the proportion of fossil fuel electricity generation that is efficient. It also controls the efficiency of fossil fuel extraction and refining.  Proportion of solid fuel plants that are either ultra-supercritical or supercritical (%)"), detailed_lever_guides_u29(), "'Detailed lever guides'!U29");
  assert_equal(EXCEL_STRING("In 2011, fossil fuels were the world’s main source of energy, with 82% of global primary energy coming from fossil fuels. Improving fossil fuel power plant efficiencies could therefore be a powerful lever to decrease carbon dioxide emissions. As described below, efficient technologies are already available, but long power plant lifetimes of around 50 years make market adaptation relatively slow. Further technological improvements may reduce carbon dioxide emissions and the cost for highly efficient technologies. Increases in carbon taxation could also speed up the transition to more efficient power plant technologies. While Japan and South Korea mainly employ efficient coal power technologies (more than 70% of all coal power plants) most other major industrial nations have relatively inefficient power plants (less than 40% of all coal power plants) due to their low initial investment costs and the high lifespans. This shows the large potential for efficiency improvement.  "), detailed_lever_guides_v29(), "'Detailed lever guides'!V29");
  assert_equal(EXCEL_STRING("It is worth considering the three types of power plant separately – gaseous (for natural gas), liquid (oil) and solid (coal or possibly biomass) fuel. Gaseous fuel: There are two main types of gas-fired power plants. The open-cycle gas turbine (OCGT) consists of a single compressor/gas turbine being connected to an electricity generator. About two-third of the generated energy is used to compress air for the combustion process. The second technology is combined-cycle gas turbines (CCGT) that basically consist of the same components as an OCGT. However, the turbine exhaust is re-used to generate energy with a heat recovery steam engine.\r\rThe thermal efficiency of OCGT lies currently between 35 – 42% and is expected to increase up to 45% by 2020. The thermal efficiency of CCGT lies currently between 52 – 60% and is expected to increase up to 64% by 2020. While the initial investment cost is slightly higher for CCGT, the annual operation and maintenance costs are much lower ($73/kWh compared to $210/MWh for OCGT) today. Building CCGT is therefore more beneficial in the long run in terms of costs and carbon dioxide emissions.\r\rLiquid fuel: The technological concepts for oil fired power plants are very similar to natural gas fired power plants. The model considers two types of plants: low efficiency power plants (<50% efficiency) and high efficiency power plants (>50% efficiency). Similar to gaseous fuel, higher efficiencies can be achieved when re-using the exhaust for power generation.\r\rSolid fuel: There are three main technologies for power generation from coal. In all three, coal is pulverised into fine powder, and the larger surface area allows for a more efficient combustion process. The pressure and temperature in the combustion chamber are the main difference between subcritical, supercritical and ultra-supercritical power plants.\rThe thermal efficiency of coal fired power plants increases with temperature and pressure, leading to efficiency levels of around 38% for subcritical, 43% for supercritical and 45% for ultra-supercritical power plants. The initial investment costs for super critical power plants are about 10 – 20% higher than for subcritical ones and about 10% lower than for ultra-supercritical ones.\r\rIf the user selects a pathway with high solid biomass, the model will automatically allocate some biomass to be used in the solid fuel power plants.  For more detail on this, see the “solid / liquid / gas” lever description."), detailed_lever_guides_w29(), "'Detailed lever guides'!W29");
  assert_equal(EXCEL_STRING("By 2050, the proportion of gas plants that are efficient is lower than today.  This is a low level of ambition.  It could be consistent with a world in which investors prefer low initial costs for gas fuel power plants and the proportion of low-efficient plants increases compared to 2011."), detailed_lever_guides_x29(), "'Detailed lever guides'!X29");
  assert_equal(EXCEL_STRING("In 2050, the proportion of efficient solid and liquid power plants is considerably higher than 2011, while for gas fuel the low efficiency technology is still preferred. This is an ambitious level of effort.  "), detailed_lever_guides_y29(), "'Detailed lever guides'!Y29");
  assert_equal(EXCEL_STRING("In 2050, considerable efforts of the fossil fuel electricity industry have led to a fast implementation of high efficiency power plants. Particularly, the proportion of high efficient liquid and gas fuel power has increased. This is a very ambitious level of effort."), detailed_lever_guides_z29(), "'Detailed lever guides'!Z29");
  assert_equal(EXCEL_STRING("In 2050, the proportion of efficient power plants is increased considerably.  This is an extraordinarily ambitious and extreme level of ambition."), detailed_lever_guides_aa29(), "'Detailed lever guides'!AA29");
  assert_equal(EXCEL_STRING("1 Gas-Fired Power, IEA, Energy Technology Network, 2010.\r2 Technology Roadmap, High Efficiency Low Emission Coal Fired Power Generation, IEA, 2012.\r"), detailed_lever_guides_ab29(), "'Detailed lever guides'!AB29");
  assert_equal(EXCEL_STRING("This lever controls the amount of electricity that is generated using power stations that are fitted with Carbon Capture and Storage facilities."), detailed_lever_guides_u30(), "'Detailed lever guides'!U30");
  assert_equal(EXCEL_STRING("Currently, fossil fuels are combusted in power stations to produce electricity, and the CO2 produced is released into the atmosphere (known as unabated fossil fuel power stations). However, in the future, the CO2 could be captured at the power stations, and then pumped into deep underground structures, such as depleted oil and gas reserves, so that it is not released into the atmosphere.\r\rIn 2011 there were only small demonstration CCS projects. In comparison, the capacity of unabated fossil fuelled power stations was approximately 3,600 GW (from coal, gas and oil fired generation) and 15,049 TWh per year of electricity."), detailed_lever_guides_v30(), "'Detailed lever guides'!V30");
  assert_equal(EXCEL_STRING("The big advantage of CCS power stations is that they can produce electricity with a low emission intensity: approximately 90% of CO2 emissions released by burning the fossil fuel can be captured by a CCS power station. However, it takes energy to capture CO2 and pump it underground, so new power stations that are fitted with CCS facilities in the future are likely to have lower energy efficiencies than unabated fossil fuel power stations. This means that more fossil fuel feedstock would be required to produce the same amount of energy in a CCS power station than an unabated power station. \r\rCurrently CCS technologies are unproven at a commercial level, and there are worries that the technology may not be commercially viable in the future owing to the higher costs involved, in comparison to unabated fossil power stations. However, significant research is under way to improve the performance of CCS technologies and hence reduce the costs, for example, by reducing the energy requirements of separating and storing the CO2.\r"), detailed_lever_guides_w30(), "'Detailed lever guides'!W30");
  assert_equal(EXCEL_STRING("Only experimental CCS power stations exist in 2050, representing a case where CCS is shown not to be technically or economically feasible. This results in 16 GW capacity of power stations with CCS operating by 2050."), detailed_lever_guides_x30(), "'Detailed lever guides'!X30");
  assert_equal(EXCEL_STRING("490 GW capacity of power stations with CCS operating by 2050. Levels 2 and 3 are calculated as intermediate points between levels 1 and 4."), detailed_lever_guides_y30(), "'Detailed lever guides'!Y30");
  assert_equal(EXCEL_STRING("1,487 GW capacity of power stations with CCS operating by 2050. Levels 2 and 3 are calculated as intermediate points between levels 1 and 4."), detailed_lever_guides_z30(), "'Detailed lever guides'!Z30");
  assert_equal(EXCEL_STRING("All new ultra and super-critical coal fired power stations are fitted with CCS, plus all new Combined Cycle Gas Turbines. This results in 3,700 GW capacity of power stations with CCS operating by 2050."), detailed_lever_guides_aa30(), "'Detailed lever guides'!AA30");
  assert_equal(EXCEL_STRING("1 IEA, World Energy Outlook 2013, Page 175, Table 5.3 (for TWh generation).\r2 IEA, World Energy Outlook 2013, page 177, Fig. 5.4 (for GW installed capacity)."), detailed_lever_guides_ab30(), "'Detailed lever guides'!AB30");
  assert_equal(EXCEL_STRING("This lever controls total world nuclear power capacity (GW).\r\r\r\r"), detailed_lever_guides_u31(), "'Detailed lever guides'!U31");
  assert_equal(EXCEL_STRING("Nuclear power is a form of thermal electricity generation that uses the heat produced from nuclear reactions rather than from the combustion of fossil fuels. These reactions do not produce greenhouse gases like carbon dioxide, so it is a low-carbon source of electricity.\r\rNuclear power stations was first used commercially in the 1950s. In 2011 there were 435 operating nuclear reactors totalling 369 GW of capacity, producing around 13% of the world’s electricity. The country with the highest proportion of nuclear generation is France, with around 80%. Build rates have slowed in the last few years, but are expected to increase in the next decade, with significant new capacity planned to be built by 2020."), detailed_lever_guides_v31(), "'Detailed lever guides'!V31");
  assert_equal(EXCEL_STRING("Nuclear has some benefits compared to many other low-carbon electricity sources. It can produce a reliable supply of power, unlike some renewables such as wind and solar which are intermittent. Once built, a reactor has a lifespan of around 40 years and perhaps longer. If power plants are located close to buildings with heat demand, then the waste heat produced in the generating process can be used in district heating systems rather than being released into the atmosphere. This reduces the need for high-carbon sources of heat like gas. \r\rHowever, nuclear power has disadvantages too. Nuclear accidents, though rare, can have serious and long-term consequences. The safe disposal and storage of the radioactive waste produced by nuclear processes is also a serious challenge, as some of the substances have a half-life of many thousand – and even millions – of years. These concerns mean that some countries and organisations do not support the use of this technology.  Even in countries that support the use of nuclear power, the planning process can be long and difficult, as local residents may object to having a power plant near their homes. The meltdown of three reactors at the Fukushima Daiichi plant in Japan in 2011 has increased safety concerns, and led to more countries closing nuclear power plants before their natural lifespan has come to an end.\r\rWhen choosing levels 3 or 4, you should consider that building this amount of nuclear power is likely to result in many planning challenges and may be difficult in terms of public acceptability."), detailed_lever_guides_w31(), "'Detailed lever guides'!W31");
  assert_equal(EXCEL_STRING("No new power stations are built, and all existing plant are switched off by 2050. It is likely that some reactors would have to retire early, before the end of their technical and economic lifespan. This represents a future that has turned away from nuclear power. "), detailed_lever_guides_x31(), "'Detailed lever guides'!X31");
  assert_equal(EXCEL_STRING("Current global build rates for nuclear plants continue for the next few decades, meaning that there would be 685 GW in total by 2050. \r"), detailed_lever_guides_y31(), "'Detailed lever guides'!Y31");
  assert_equal(EXCEL_STRING("The increased build rate planned from 2011 to 2020 is sustained until 2050, meaning that there would be 1,030 GW in total. \r"), detailed_lever_guides_z31(), "'Detailed lever guides'!Z31");
  assert_equal(EXCEL_STRING("After 2020, the build rate increases to the fastest the nuclear sector believes is technically possible, and this is sustained until 2050. This would result in 1,870 GW of capacity. This represents a future which has put an extreme amount of effort into rolling out nuclear. "), detailed_lever_guides_aa31(), "'Detailed lever guides'!AA31");
  assert_equal(EXCEL_STRING("This lever controls the total global capacity of wind power (GW). It includes both onshore and offshore wind."), detailed_lever_guides_u32(), "'Detailed lever guides'!U32");
  assert_equal(EXCEL_STRING("Wind energy is a renewable source of energy that extracts the energy stored in moving air. Turbines generating electric energy from wind are installed either onshore or offshore, sometimes on farmland, and are generally connected to the power transmission network. As it is not always windy, about 15 – 50 % of the capacity is actually used at any given time, and this is very dependent on where a turbine is located.  Wind power has been used for centuries to mill flour or pump water from land below sea level. In 2011, there were close to 200,000 operating wind turbines, totalling 238 GW of capacity and producing around 3% of the world’s electricity. In 2012, China (at that time the country with the highest fraction of the world’s wind power capacity) produced more electric energy from wind than from nuclear. In 2013, the country with the highest proportion of wind power was Denmark with 33% of its energy mix.\r\rAlthough affected by the financial crisis, build rates were still growing in the last few years. The Global Wind Energy Council (GWEC) forecasts a cumulative installed capacity of 750 GW by 2020.The International Energy Agency (IEA) expects that 80% of the growth in wind power until 2035 will be onshore. The reason for this is that despite higher capacity utilisation rates, offshore wind farms are more expensive than onshore ones because of higher installation costs. \r"), detailed_lever_guides_v32(), "'Detailed lever guides'!V32");
  assert_equal(EXCEL_STRING("A key advantage of wind power is its potential to save carbon emissions. The Intergovernmental Panel for Climate Change (IPCC) assessed the emissions to be 11-12 g of carbon dioxide equivalent per kWh, which mainly arises from the production of the wind turbine. This is considerably lower than for other low carbon power sources such as solar or geothermal energy. In contrast to nuclear energy, wind energy does not produce any toxic waste that has to be stored safely for thousands of years.\r\rHowever, wind energy has also several disadvantages. Wind farms cover large areas of land that could otherwise be used differently e.g. for natural forest or housing. Ecological damage may be caused if bird migration is hindered. Since wind blows very inconsistently, the energy generation of wind turbines varies significantly. Currently, gas and coal power plants have to balance out this variation. However, in future, intelligent grids and storage techniques might be able to manage this in a smart way, and the battery capacity of electric vehicles might be used to store wind energy (for example, during night-time when the energy demand is low). Additionally, the aesthetic perception, noise pollution and shading effects can be important for people living close to wind turbines. Therefore, wind farms can usually not be built close to areas with high population densities. In contrast, wind farms and agriculture sharing the same area might be a promising combination for efficient land use.\r\rWhen choosing levels 3 or 4, land use for wind power will be significant and adaptations may be needed to the electricity supply system. The introduction of electric cars and the development of high performing storage systems might help to achieve the transition to more wind energy. \r\r"), detailed_lever_guides_w32(), "'Detailed lever guides'!W32");
  assert_equal(EXCEL_STRING("Some new wind turbines are built up to 2020 with parallel decommissioning. Thereafter, no new wind turbines are built. By 2050, there is no wind power capacity left. This scenario represents a future that has turned away from wind energy. \r"), detailed_lever_guides_x32(), "'Detailed lever guides'!X32");
  assert_equal(EXCEL_STRING("Moderately increasing build rates of wind turbines until 2050. This scenario represents a business-as-usual scenario.\r"), detailed_lever_guides_y32(), "'Detailed lever guides'!Y32");
  assert_equal(EXCEL_STRING("Strong support for wind energy. High initial growth in build rates increasing until 2050. A considerable amount of land is used to generate wind power (around 14,000 km squared)."), detailed_lever_guides_z32(), "'Detailed lever guides'!Z32");
  assert_equal(EXCEL_STRING("Very strong support for wind energy. Very high initial growth of build rates decreasing over time. Large areas (around 19,000 km squared) are covered with wind farms and the technologically possible capacity is installed until 2050. This scenario represents a future which has put an extreme amount of effort into rolling out wind energy. \r"), detailed_lever_guides_aa32(), "'Detailed lever guides'!AA32");
  assert_equal(EXCEL_STRING("1 IPCC Working Group III – Mitigation of Climate Change, Annex II I: Technology – specific cost and  performance parameters.\r2 H.J. Wagner and J. Mathur: Introduction to Wind Energy Systems Basics, Technology and Operation.  Berlin/Heidelberg 2013, S.2. \r3 European Wind Energy Association: Wind in power – 2011 European Statistics, 2011.\r4 J.M. Roney, Wind Surpasses Nuclear in China, Earth Policy Institute, 2013.\r5 World Energy Outlook, IEA, 2013. \r6 Global Wind Report Annual Market Update 2013, Global Wind Energy Council, 2011.\r"), detailed_lever_guides_ab32(), "'Detailed lever guides'!AB32");
  assert_equal(EXCEL_STRING("This lever controls total global hydroelectric power capacity (GW). "), detailed_lever_guides_u33(), "'Detailed lever guides'!U33");
  assert_equal(EXCEL_STRING("Hydroelectricity is a renewable source of energy that is based on the natural cycle of water. Hydropower is generated by flowing or falling water that turns a turbine. This working principle can also be reversed to store energy when water is pumped to a higher-lying tank which makes hydropower a very flexible technology. \r\rHaving been used for thousands of years, hydropower is one of the most mature and reliable power generation technologies. Hydroelectricity is today the largest renewable energy source, with around 11,000 power plants worldwide with a capacity of about 1,200 GW (in 2011) contributing around 16% of the world’s electricity. Currently, 25 countries have a proportion of greater than 90% of hydropower in their energy mix – Norway’s electricity supply, for instance, is based on 99% hydroelectricity. \r\rIn recent years, the build rate of hydropower has increased. With less than one-quarter of the hydropower potential currently operating, the prospects for continued capacity growth are good.\r"), detailed_lever_guides_v33(), "'Detailed lever guides'!V33");
  assert_equal(EXCEL_STRING("Hydroelectricity has the unique advantage, compared to other renewable sources, that it can be used to store energy when needed. It can switch between energy storage and generation modes within a short span of time, making it a complementary partner for other renewable sources such as wind and solar energy with variable energy output. Depending on geology and construction, hydropower can potentially be the cleanest of all forms of renewable energies with 1 g carbon dioxide equivalent per kWh.\r\rHowever, hydropower has several disadvantages. The main one is land use when flooding large areas to store water. The reservoir of the Three-Gorges-Dam in China, for instance, covers an area of 1,045 km2 which is about half the size of Luxembourg. Several villages had to be displaced and the ecosystem was drastically affected. This environmental impact raises strong public and political objections against hydroelectricity in various countries. It is therefore unclear how much of the three quarters of unused hydropower potential will be finally used. There has also been debate about potential emissions of methane from the bottom of reservoirs due to huge water pressure on the surface, which could cause problems with large hydroelectric projects.\r\rTo choose levels 3 or 4, you would need to believe that land use for hydroelectric power will be significant, and that that there is high public and political support for it. \r"), detailed_lever_guides_w33(), "'Detailed lever guides'!W33");
  assert_equal(EXCEL_STRING("In this scenario, new hydroelectric power is not supported, perhaps because of concerns about high land use and other environmental effects. Current capacity and all projects that have been under construction or commissioned will run until 2050 totalling a capacity of 1,188 GW."), detailed_lever_guides_x33(), "'Detailed lever guides'!X33");
  assert_equal(EXCEL_STRING("Hydropower steadily grows by 1.5% a year. Under this level, public opinion on hydroelectricity is positive and new hydropower plants are constructed where reasonable in terms of land use. The capacity in 2050 will be 1,750 GW. "), detailed_lever_guides_y33(), "'Detailed lever guides'!Y33");
  assert_equal(EXCEL_STRING("Hydropower grows at a steady rate of 2% a year. This scenario assumes continued investment in large hydroelectricity and technology upgrading, and is based on a positive attitude toward hydropower in the population."), detailed_lever_guides_z33(), "'Detailed lever guides'!Z33");
  assert_equal(EXCEL_STRING("Hydropower steadily grows by 3% per year. This scenario is close to the limiting growth rate of 3.55% needed to realize the entire hydro potential by 2050. People are willing to sacrifice large areas of land for hydropower. By 2050 the total capacity is 2,375 GW."), detailed_lever_guides_aa33(), "'Detailed lever guides'!AA33");
  assert_equal(EXCEL_STRING("1 Renewable energy technologies: cost analysis series, Volume 1: Power Sector, Issue 3/5, Hydropower, International Renewable Energy Agency (IRENA), 2012.\r2 IPCC Working Group III – Mitigation of Climate Change, Annex II I: Technology – specific cost and performance parameters. IPCC 2014.\r"), detailed_lever_guides_ab33(), "'Detailed lever guides'!AB33");
  assert_equal(EXCEL_STRING("This lever controls total global capacity of marine power (GW). This includes energy generated from both wave and tidal energy."), detailed_lever_guides_u34(), "'Detailed lever guides'!U34");
  assert_equal(EXCEL_STRING("Marine power is a renewable source of energy that can be divided into wave and tidal energy. Wave energy uses the energy produced when the wind creates ocean surface waves, while tidal energy extracts the energy from sea level changes due to the attraction of the moon. \r\rWave power is still at a concept stage and has not been commercialised yet. The worldwide potential of wave energy was estimated to be 2,000 GW. The highest potential regions include the Pacific coastlines of North and South America, Australia and New Zealand and the Atlantic seaboard of Western Europe. The main competitor for wave power is offshore wind power.\r\rThe principle of tidal power was already used by tide mills in England and France in the 17th century, and the first large-scale tidal power plant was opened in France in 1966. While 3,000 GW or more of tidal energy is estimated to be globally available, less than 3% of this can be realistically used for power generation because of geological inaccessibility. In 2011, the global capacity of tidal power was 0.5 GW.\r"), detailed_lever_guides_v34(), "'Detailed lever guides'!V34");
  assert_equal(EXCEL_STRING("Marine power has huge potential but this is limited by its high initial investment costs. But tidal power plants also have several advantages compared to other low carbon technologies. Very long lifespans of around 120 years reduce the overall long-term costs and the barriers can also be a protection against costal flooding which might be an important feature under potential future sea levels rises due to climate change. \r\rHowever, there are also several disadvantages compared to other renewable sources of energy. So far, the main competitor, offshore wind power, has considerably lower payback times. Additionally, there are some environmental concerns. Rotating blades of turbines might accidentally injure or deter sea life. One of the main concerns regarding wave energy might be the small number of suitable locations for marine power generation.\r\rTo choose levels 3 or 4, you would need to believe wave energy has high potential for offshore installation. You would also need to accept that large parts of the coastal area would need to be made available for marine power plants. \r"), detailed_lever_guides_w34(), "'Detailed lever guides'!W34");
  assert_equal(EXCEL_STRING("By 2050, there is 0 GW of tidal energy as the present installation will have passed its technical lifespan, and there will be 8 GW of wave energy. This scenario is very pessimistic about the prospect of tidal energy and acknowledges concerns regarding environmental threats."), detailed_lever_guides_x34(), "'Detailed lever guides'!X34");
  assert_equal(EXCEL_STRING("Marine power technology matures slowly. Environmental or economic concerns hold back marine energy. By 2050, there is 35 GW of tidal electricity and 62 GW of wave energy. "), detailed_lever_guides_y34(), "'Detailed lever guides'!Y34");
  assert_equal(EXCEL_STRING("Marine energy has more public and political support. By 2050, there is 132 GW of tidal electricity and 105 GW of wave energy. Build rates are enhanced, probably with quicker construction times, and improved technology. "), detailed_lever_guides_z34(), "'Detailed lever guides'!Z34");
  assert_equal(EXCEL_STRING("By 2050, there is 293 GW of tidal energy and 143 GW of wave energy. This scenario considers fast technical maturity and public acceptance of marine energy. Large parts of the coastline are now used for marine power plants.  "), detailed_lever_guides_aa34(), "'Detailed lever guides'!AA34");
  assert_equal(EXCEL_STRING("1 The World Offshore Renewable Energy Report 2004-2008. PAA energy, 2008.\r2 The Tethy database (http://tethys.pnnl.gov) provides more detailed information regarding the effect of tidal power on sea life.\r"), detailed_lever_guides_ab34(), "'Detailed lever guides'!AB34");
  assert_equal(EXCEL_STRING("This lever controls total world solar power capacity (GW).  This includes both solar photovoltaic (PV) and concentrated solar power."), detailed_lever_guides_u35(), "'Detailed lever guides'!U35");
  assert_equal(EXCEL_STRING("Solar energy is a type of renewable energy which converts energy from sunlight into electricity. Every year, 1.5 × 1018 kWh of solar power reaches the earth’s surface, which is more than 10,000 times the current global energy demand.\r\rThere are different technologies to harvest solar energy. The most popular is photovoltaics (PV) from crystalline silicon with efficiencies of around 16% (currently about 80 to 95 % of the PV market). The rest of the PV market is shared between amorphous Silicon, Cadmium-Telluride (CaTe) and Copper-Indium-Gallium-Diselenide (CIGS). In 2011, the global capacity of PV was 70 GW, of which 80% was installed in just a few countries such as Germany, Spain and Japan. \r\rAnother approach is Concentrated Solar Power (CSP). Mirrors concentrate light on an absorbing device which heats up a thermal fluid that drives a conventional steam turbine. Typical CSP plants have a capacity of 0.01 – 0.08 GW and an efficiency of 14 to 16%. As the sun is not always shining and only direct sunlight is correctly concentrated by the mirrors, about 25 to 30% of the capacity is used for electricity generation depending on the location. In 2011, a capacity of 1.6 GW was operating, mainly in Spain and the United States. \r  \r"), detailed_lever_guides_v35(), "'Detailed lever guides'!V35");
  assert_equal(EXCEL_STRING("Solar PV is a strongly growing technology, which capacity increases of around 40% per year in the last couple of years. In recent years this was mainly due to financial support from governments (e.g. China, India, Germany and Spain). The price for crystalline silicon solar cells is continuously falling, reaching a level below $0.40 per Watt peak in 2014 according to Bloomberg. This is cheap enough to achieve cost parity in countries with high solar irradiation such as Italy and Spain. It is therefore likely that solar PV will continue to grow fast in the future, with prices for solar PV likely to decrease even further.\r\rLike all technologies, PV is not completely carbon neutral, as the purification process of silicon in particular is very energy intensive. After around 3 years of operation, the initial carbon emissions are saved, and lifetimes easily exceed 20 years. Other technologies, such as organic PV and some thin film technologies are less carbon intensive. It is possible that one of those technologies might overtake silicon, with increasing governmental spending in solar R&D.\r\rThe cost for concentrated solar power (CSP) is currently higher than for solar PV. However an advantage of CSP is that the generated energy can be stored in a molten salt storage system over a period of several hours which may enable it to serve peak loads on the same day.\r\rElectricity generated from CSP could also be used elsewhere. The goal of the Desertec consortium, for instance, was to harvest solar power in North Africa and transfer it with an efficient grid to Europe. A key concern of this type of projects is the very high investment cost. Another major challenge for CSP is that it requires a lot of water, in what are usually very dry areas. Additionally, electricity transport with the current grid technology would suffer from considerable energy loss over such a long distance and therefore further effort in R&D is needed. Besides technical, financial and regulatory drawbacks, the safety and security of solar installations is becoming a big challenge in developing countries. As remote installations may lack proper security arrangements, there may be problems of theft and asset destruction which may deter new investors. \r\rTo choose levels 3 or 4, you would need to believe that solar power will have a considerable share in the energy mix of 2050. This would probably require technology improvements and cost reductions, along with supportive policy. \r"), detailed_lever_guides_w35(), "'Detailed lever guides'!W35");
  assert_equal(EXCEL_STRING("By 2050, the world has turned away from solar power with a total capacity is 0 GW. Under this scenario, build rates stay at their current level until 2020. Thereafter, solar is either decommissioned or retires at the end of its technical life span. "), detailed_lever_guides_x35(), "'Detailed lever guides'!X35");
  assert_equal(EXCEL_STRING("By 2050, the total capacity of solar power is 1,199 GW. Technologies have moderately improved, probably leading to a fall in costs. "), detailed_lever_guides_y35(), "'Detailed lever guides'!Y35");
  assert_equal(EXCEL_STRING("By 2050, the total capacity of solar power is 2,739 GW, probably driven by better technology and lower prices. Build rates for solar PV and concentrated solar power continue to increase."), detailed_lever_guides_z35(), "'Detailed lever guides'!Z35");
  assert_equal(EXCEL_STRING("By 2050, solar power has a capacity of 4,817 GW. Both solar PV and concentrated solar power have improved and new technologies, such as printable photovoltaics, may be a big part of the market. Storage capacity is also increased significantly. Level 4 is based on Shell’s “Oceans” scenario."), detailed_lever_guides_aa35(), "'Detailed lever guides'!AA35");
  assert_equal(EXCEL_STRING("1 Concentrating solar power, Technology brief, IRENA, 2013.\r2 Technology roadmap, Solar photovoltaic energy, IEA, 2008.\r"), detailed_lever_guides_ab35(), "'Detailed lever guides'!AB35");
  assert_equal(EXCEL_STRING("This lever controls total world geothermal power capacity (GW). Geothermal power uses the heat from dry rocks deep underground. "), detailed_lever_guides_u36(), "'Detailed lever guides'!U36");
  assert_equal(EXCEL_STRING("Geothermal energy is thermal energy that originates mainly from the radioactive decay of minerals. This energy can either be used directly for heating or electricity generation. Geothermal energy is considered as a renewable source of energy because the energy extracted from the earth is negligible compared to the amount of energy stored in the core.\r\rIn 2012, the global capacity for geothermal electricity generation was 11.6 GW, and the capacity of directly used geothermal heat was about 28 GW. Around 24 counties used geothermal electricity and 70 countries used geothermal heat. Geothermal power plants have traditionally been built on the edges of tectonic plates, since the temperatures close to the surface are higher. The maximum potential lies in countries located on the so-called “Ring of Fire”, a zone of major seismic activity including volcanoes and earthquakes in the basin of the Pacific Ocean. This is why the United States, the Philippines and Indonesia are the countries with the highest geothermal capacity in 2011.\r\rAn optimistic outlook from the International Energy Agency (IEA) predicts that geothermal electricity could have 3.5% of the world’s energy generation. \r"), detailed_lever_guides_v36(), "'Detailed lever guides'!V36");
  assert_equal(EXCEL_STRING("Geothermal has several benefits compared to other energy sources. In particular the minimal freshwater and land requirements are strong advantages. A geothermal plant uses on average an area of 3.5 km2 per GW, which is about 90% less than for coal and 70% less than for wind farms. In terms of fresh water, geothermal uses 20 litres per MWh compared to more than 1,000 litres per MWh that are usually needed for coal electricity generation.\r\rIn contrast, geothermal energy also has disadvantages. Although being a renewable source of energy, power generation does need to be monitored as there is evidence for local depletion – ground and groundwater temperatures can be reduced, resulting in a reduction of power plant efficiency. Also during the process of thermal electricity generation, greenhouse gases are dissolved from the ground which are subsequently released in the atmosphere - this effect is comparably small so that carbon dioxide equivalent emissions over the lifespan of a geothermal power plant is still lower than for solar cells but higher than for wind, hydro and nuclear power (IPCC). Another issue might be the limited amount of well-suited sites with optimal power generation efficiencies on edges of tectonic plates. If geothermal is promoted further in the future, lower plant efficiencies have to be accepted.\r\rTo choose levels 3 or 4, you would need to believe that geothermal power plants will also be built at locations with lower efficiencies, which would involve higher economic costs.\r"), detailed_lever_guides_w36(), "'Detailed lever guides'!W36");
  assert_equal(EXCEL_STRING("By 2050, there is 0 GW of geothermal electricity. Current geothermal power plants are removed from the grid at the end of their lifespan. In this scenario geothermal energy is not supported and other energy sources are used instead."), detailed_lever_guides_x36(), "'Detailed lever guides'!X36");
  assert_equal(EXCEL_STRING("New geothermal power plants are mainly built in locations with high geothermal potential – those involve in particular the Ring of Fire countries. The build rate is moderate and relates to the different lifespans of power plants. By 2050, there is 172 GW of geothermal electricity. "), detailed_lever_guides_y36(), "'Detailed lever guides'!Y36");
  assert_equal(EXCEL_STRING("Under this scenario other countries promote geothermal energy as well as the Ring of Fire countries. This results in an increased average growth rate of geothermal energy. By 2050, there is 289 GW of geothermal electricity."), detailed_lever_guides_z36(), "'Detailed lever guides'!Z36");
  assert_equal(EXCEL_STRING("Geothermal energy is supported by countries around the world. Lower conversion efficiencies are accepted because of suboptimal locations, resulting in build rates of up to 12% between 2020 and 2040. In the last ten years before 2050, the geothermal market begins to reach saturation as it nears its maximum capacity. By 2050, there is 404 GW of geothermal electricity."), detailed_lever_guides_aa36(), "'Detailed lever guides'!AA36");
  assert_equal(EXCEL_STRING("1 http://www.iea.org/publications/freepublications/publication/Geothermal_Foldout.pdf\r2 Lund J. W. Characteristics, Development and Utilization of Geothermal Resources. Geo-Heat Centre Quarterly Bulletin / Oregon Institute of Technology, June 2007, pp.1.  \r3 Rybach L. Geothermal Sustainability, Geo-Heat Centre Quarterly Bulletin / Oregon Institute of Technology, September 2007, pp.2. \r4 IPCC Working Group III – Mitigation of Climate Change, Annex II I: Technology – specific cost and performance parameters. IPCC, 2014, p. 10.\r"), detailed_lever_guides_ab36(), "'Detailed lever guides'!AB36");
  assert_equal(EXCEL_STRING("This lever controls the total global electricity storage capacity (GW). Electricity can be stored either electrochemically by batteries or mechanically, for example, by compressing air.  "), detailed_lever_guides_u37(), "'Detailed lever guides'!U37");
  assert_equal(EXCEL_STRING("Electricity storage technologies could link very well with large-scale implementation of renewable energy sources. Solar and wind energy is generated whenever the sun is shining or the wind is blowing, regardless of the level of demand, but by using storage, electricity can be stored during off-peak time and released when needed.\r\rEnergy storage technologies could include a variety of battery technologies such as sodium-sulphur batteries, advanced lead acid batteries, flow batteries, and lithium ion batteries for utility-scale storage. Many of these storage systems could be used to store off-peak power generated by renewable technology. Pumped storage based on hydroelectricity and compressed-air energy storage (CAES) provide larger storage capacities of more than 0.2 GW per unit.\r\rIn 2011, there was around 120 GW of electricity storage plants, 99% relying on pumped storage and mainly located in OECD countries. This might be due to offering the lowest costs of $0.10 per kWh (over its lifetime) compared to other large-scale electricity storage technologies.\r"), detailed_lever_guides_v37(), "'Detailed lever guides'!V37");
  assert_equal(EXCEL_STRING("The capacity of storage technologies varies considerably. Batteries have small capacities, but might be useful for homeowners who would like to store their self-produced renewable energy. \r\rFor large capacities, the two main approaches are pumped storage and CAES. A large proportion of the worldwide potential of pumped storage has already been exploited making strong growth of this technology unlikely. CAES, however, is still at an experimental stage, with the challenge of comparably low storage efficiencies of around 40% (compared to 70-75% for pumped storage). Improvement is needed to make CAES a viable option.\r\rSince storage techniques are so important for renewable energies, countries must invest in related research and development. In order to accomplish this goal, an appropriate regulatory framework has to be set in the coming years. According to Pike Research, a market research firm, around $100 billion could potentially be invested worldwide in the field of energy storage between 2011 and 2021. \r\rTo choose levels 3 or 4, you would need to believe that there will be fast technological progress of large-scale storage technologies. This would probably be based on a regulatory framework supporting renewable and storage technologies. \r\r"), detailed_lever_guides_w37(), "'Detailed lever guides'!W37");
  assert_equal(EXCEL_STRING("Under this scenario, energy storage is not needed (possibly because of a lower emphasis on renewable energy) and only some pump storage power plants are built. By 2050, there is around 152 GW of energy storage capacity."), detailed_lever_guides_x37(), "'Detailed lever guides'!X37");
  assert_equal(EXCEL_STRING("Technological progress of large-scale storage technologies is moderate. By 2050, there is around 600 GW of energy storage capacity."), detailed_lever_guides_y37(), "'Detailed lever guides'!Y37");
  assert_equal(EXCEL_STRING("Governments invest in research and development of novel storage technologies and progress is fast. This may be driven by renewable energies playing an important role in the global energy mix.  By 2050, there is around 800 GW of energy storage capacity."), detailed_lever_guides_z37(), "'Detailed lever guides'!Z37");
  assert_equal(EXCEL_STRING("High adoption of storage technologies across the globe, complementing renewable sources of energy. Heavy investment in the field of storage technologies results in very fast technological progress. By 2050, there is around 1,200 GW of energy storage capacity."), detailed_lever_guides_aa37(), "'Detailed lever guides'!AA37");
  assert_equal(EXCEL_STRING("1 http://www.economist.com/node/21548495\r2 Renewable energy technologies: cost analysis series, Volume 1: Power Sector, Issue 3/5, Hydropower, International Renewable Energy Agency (IRENA), 2012.\r"), detailed_lever_guides_ab37(), "'Detailed lever guides'!AB37");
  assert_equal(EXCEL_STRING("This lever controls the global average quantity of calories consumed per person each day"), detailed_lever_guides_u38(), "'Detailed lever guides'!U38");
  assert_equal(EXCEL_STRING("In 2011, the global average calorie consumption was 2,180 kcal per person per day. This value represents the effective calorie intake by person and excludes losses along the supply chain (currently approximately 24% of food energy content). This average value is greater than the recommended consumption by the World Health Organisation of 2,100 kcal per person per day. However, food consumption is not distributed evenly throughout the world, and in some regions extremes exist, such as undernourishment and obesity. For example, approximately 805 million people in the world do not currently have enough food to lead a healthy, active life. On the other hand, in 2010, more than 1.4 billion adults were overweight (BMI > 25) of which 500 million were obese (BMI > 30).\r\rPeople living in developed countries generally consume more calories than in developing countries. For example, in 2011 people in the USA and the EU consumed on average 2,729 and 2,520 kcal per person per day respectively, whilst in Bangladesh people consumed on average 1,823 kcal per person per day. It has therefore been projected that food consumption will increase in the future, as people in developing countries move to higher-calorie diets. For example, Alexandratos and Bruinsma (2012) projected that food consumption will increase by 11% between 2007 and 2050. However, if food consumption could be distributed more evenly, people could move to healthier diets with less obesity and undernourishment, without significantly increasing total calorie intake. \r"), detailed_lever_guides_v38(), "'Detailed lever guides'!V38");
  assert_equal(EXCEL_STRING("The land and emissions impact of diet is affected by the type of food consumed as well as the total calories. You can control this using the ‘quantity of meat’ and ‘type of meat’ levers.\r\rPlease note that these figures represent global averages, and that the calories required for each individual will vary according to body mass, gender, age, physical activity and climate. \r\rDifferent countries and institutions have different recommendations around what constitutes a healthy diet.  For example, see:\r• The Harvard School of Public Health’s healthy eating plate [http://www.hsph.harvard.edu/nutritionsource/healthy-eating-plate] \r• The World Health Organisation’s recommendations [http://whqlibdoc.who.int/trs/WHO_TRS_935_eng.pdf] for details from \r• The India National Institute of Nutrition’s dietary recommendations [http://ninindia.org/DietaryguidelinesforIndians-Finaldraft.pdf]\r\rAgricultural land to grow crops and feed animals currently takes up 37% of the world’s land surface, whereas forests represent 31% (FAO, 2014). Increased demand for food could be met either through increases in yields or an expansion of agricultural land. Increases in the production of food from each unit of existing agricultural land (the yield) may be able to increase food supplies enough to supply the additional food required for 8.3 to 10.9 billion people by 2050 without having to convert native ecosystems to agricultural land.\r\rHowever, agricultural land expansion could put pressure on existing forests if this yield increase doesn’t take place. Conversion of forest land to crop land or pasture can release greenhouse gas emissions (carbon stored on the land is oxidised to CO2).  Please therefore bear your choice of calorie consumption in mind when you consider the ‘Food’ and ‘Diet’ levers. To see how your choices affect how land is used in the future, please visit the ‘Resources’ tab in the model and select ‘Land’.  "), detailed_lever_guides_w38(), "'Detailed lever guides'!W38");
  assert_equal(EXCEL_STRING("By 2050, the global average calorie consumption increases to the current European level of 2,520 kcal per person per day. This represents an extreme scenario, where the entire world would reach European levels of food consumption with high risks of obesity, diabetes and cardiovascular problems. "), detailed_lever_guides_x38(), "'Detailed lever guides'!X38");
  assert_equal(EXCEL_STRING("By 2050, the global average calorie consumption increases to a level similar to projections by the UN's Food and Agricultural Organisation (FAO) (Alexandratos and Bruinsma, 2012, adjusted to exclude food losses) of 2,330 kcal per person per day. In this trajectory, there would be a significant increase of food consumption globally, but the current trend of increased calorie consumption would be slightly reduced by population and consumption peaks in some countries."), detailed_lever_guides_y38(), "'Detailed lever guides'!Y38");
  assert_equal(EXCEL_STRING("In 2050, the global average calorie consumption is the same as in 2011 of 2,180 kcal per person per day. This scenario could represent a redistribution of calorie intake, where some developing countries increase food consumption (e.g. by reducing poverty), whilst some developed countries reduce their consumption. Alternatively, it could represent current levels of inequality of food consumption between regions, or further levels of inequality."), detailed_lever_guides_z38(), "'Detailed lever guides'!Z38");
  assert_equal(EXCEL_STRING("By 2050, global average calorie consumption reduces to the target for a healthy diet of 2100 kcal per person per day (2,200 for men, and 2,000 for women). This could represent a redistribution of calorie intake, where some developing countries increase food consumption (e.g. by reducing poverty), whilst some developed countries reduce their consumption by tackling obesity issues. Alternatively, it could represent current levels of inequality of food consumption between regions, or further levels of inequality. Overall, this is an extreme target, given that calorie intake values below this global average would result in more cases of undernourishment."), detailed_lever_guides_aa38(), "'Detailed lever guides'!AA38");
  assert_equal(EXCEL_STRING("1 Alexandratos, N.; Bruinsma, J. (2012). World Agriculture Towards 2030/2050: The 2012 Revision. FAO Report, ESA Working Paper No. 12-03, June 2012. Global Perspective Studies Team, UN FAO, Rome. \r2 FAO (2014). Online database of the FAO Statistics Division. UN FAO, Rome. Available at: http://faostat.fao.org\r3 Lipinski, B. et al. 2013. “Reducing Food Loss and Waste.” Working Paper, Installment 2 of Creating a Sustainable Food Future. Washington, DC: World Resources Institute. Available online at http://www.worldresourcesreport.org\r4 WHO (2014) Obesity and Overweight. Factsheet N.311. http://www.who.int/mediacentre/factsheets/fs311/en/\r"), detailed_lever_guides_ab38(), "'Detailed lever guides'!AB38");
  assert_equal(EXCEL_STRING("This lever controls the global average quantity of meat consumed per person each day (kcal per person per day). Fish is not considered as ‘meat’ in this lever, but is also taken into account in the estimates."), detailed_lever_guides_u39(), "'Detailed lever guides'!U39");
  assert_equal(EXCEL_STRING("Currently people in developing countries consume less meat on average than those in developed countries. Growing incomes in developing countries tend to promote an increase in meat consumption. Global average meat consumption has therefore been increasing since the 1970s.  The UN's Food and Agricultural Organisation (FAO) forecast by Alexandratos and Bruinsma (2012) predicts that meat consumption per person will continue to rise to around 220 kcal per person per day in 2050."), detailed_lever_guides_v39(), "'Detailed lever guides'!V39");
  assert_equal(EXCEL_STRING("Different countries and institutions have different recommendations around what constitutes a healthy diet.  For example, see:\r• The Harvard School of Public Health’s healthy eating plate [http://www.hsph.harvard.edu/nutritionsource/healthy-eating-plate] \r• The World Health Organisation’s recommendation of 90g of meat per person per day [http://whqlibdoc.who.int/trs/WHO_TRS_935_eng.pdf] \r• The India National Institute of Nutrition’s dietary recommendations [http://ninindia.org/DietaryguidelinesforIndians-Finaldraft.pdf]\r\rMeat production is, on average, associated with significantly higher greenhouse gas emissions than the production of grains, fruit and vegetables per unit of energy output. It also requires more land, as meat production is much less land efficient than growing crops. For example, in 2011 an area the size of a football pitch would typically yield around 25,000 kcal per year of pasture fed beef, 1,450,000 kcal per year of poultry, or 5,410,000 kcal per year of crops (for example, grains). A shift to lower levels of meat consumption could therefore help to reduce the greenhouse gas footprint of our diets, as well as produce surplus land that could be used for other purposes, such as growing bioenergy crops and establishing new forests.\r\rIn 2011 the global average fish consumption was 27 kcal per day per person, representing 1.4% of total non-meat calories. In all cases, it was assumed that fish calories would represent 2.1% of our non-meat calories in 2050, according to market trends.\r\rThis lever controls effective kcal intake per person.  Users wishing to explore the impact of more or less food waste should use the “wastes and residues” lever.  Losses along the supply chain are currently approximately 19% in terms of meat energy content [Lipinski et al., 2013]."), detailed_lever_guides_w39(), "'Detailed lever guides'!W39");
  assert_equal(EXCEL_STRING("Very high consumption of meat per person per day. This level assumes the total meat consumption per person in Europe in 2011 as a global target for 2050."), detailed_lever_guides_x39(), "'Detailed lever guides'!X39");
  assert_equal(EXCEL_STRING("The global average meat consumption in 2050 is 220 kcal per person per day, similar to that forecast by the UN's Food and Agriculture Organisation (FAO)."), detailed_lever_guides_y39(), "'Detailed lever guides'!Y39");
  assert_equal(EXCEL_STRING("World Health Organisation recommended meat consumption of 90 g meat/day (around 152 kcal per person per day) for a healthy diet by 2050."), detailed_lever_guides_z39(), "'Detailed lever guides'!Z39");
  assert_equal(EXCEL_STRING("Extremely low global average meat consumption in 2050, which reflects India’s 2011 average meat consumption.  This lever considers vegetarian diets and meat alternatives (e.g. soy meat substitutes, yeast-based meat and potential stem cell-based technologies). It represents an extreme situation and assumes an unprecedented change in dietary preferences worldwide."), detailed_lever_guides_aa39(), "'Detailed lever guides'!AA39");
  assert_equal(EXCEL_STRING("1 Alexandratos, N.; Bruinsma, J. (2012). World Agriculture Towards 2030/2050: The 2012 Revision. FAO Report, ESA Working Paper No. 12-03, June 2012. Global Perspective Studies Team, UN FAO, Rome. \r2 Lipinski, B. et al. 2013. “Reducing Food Loss and Waste.” Working Paper, Installment 2 of Creating a Sustainable Food Future. Washington, DC: World Resources Institute. Available at: http://www.worldresourcesreport.org "), detailed_lever_guides_ab39(), "'Detailed lever guides'!AB39");
  assert_equal(EXCEL_STRING("This lever controls the global average proportion of meat calories consumed that is from ruminant animals (cows and other bovines, sheep and goats). This is important because ruminant animals are generally responsible for more greenhouse gas emissions due to their methane emissions from enteric fermentation and require more pasture land than non-ruminants (such as pigs and poultry). Therefore, a shift from a ruminant to a predominantly non-ruminant meat diet can help to significantly reduce the carbon footprint of our diets."), detailed_lever_guides_u40(), "'Detailed lever guides'!U40");
  assert_equal(EXCEL_STRING("Ruminants include cows and other bovines, sheep and goats. These animals have four-chambered stomachs that allow them to digest fibrous plant-based food (such as grass) efficiently and, on average, are responsible for more greenhouse gas emissions per unit of meat produced than non-ruminants. Non-ruminants are also known as monogastric animals and include chicken and pigs; these animals have simple, single-chambered stomachs and are therefore less efficient than ruminants at extracting energy from fibrous plant-based food.\r\rThe share of ruminant meat in the average global diet has reduced steadily since the 1970s (although owing to increasing meat consumption, absolute production has increased), whereas the share of non-ruminant meat (in particular poultry) has been increasing. Currently, meat from non-ruminants constitutes the dominant share of meat consumed globally. The share of ruminant meat varies significantly between different countries. For example, in Brazil 38% of all meat energy consumed is from ruminant animals, whereas in China only 9% is from ruminants.\r\rThe UN's Food and Agricultural Organisation (FAO) (Alexandratos and Bruinsma, 2012) forecast that between 2005/7 and 2050, total demand for all meat types will increase, with poultry demand increasing by 1.8% per year, pork demand by 0.8% per year, beef demand by 1.2% per year and sheep and goat demand by 1.5% per year. This would result in a ruminant share in 2050 of approximately 25%."), detailed_lever_guides_v40(), "'Detailed lever guides'!V40");
  assert_equal(EXCEL_STRING("The production of ruminant meat is, on average, associated with significantly higher greenhouse gas emissions than the production of non-ruminant meat per unit of energy output. One of the reasons for this is that ruminants produce methane as a by-product of their digestion process, which is a greenhouse gas with approximately 29 times the global warming potential of CO2. Ruminant animals are also generally less land efficient than non-ruminants. For example, in 2011 an area the size of a football pitch would typically yield approximately 25,000 kcal per year of pasture fed beef, 380,000 kcal per year of intensively managed beef or 1,450,000 kcal per year of poultry.\r\rA shift to lower levels of ruminant meat consumption could therefore help to reduce the greenhouse gas footprint of our diets, as well as free up land to make way for other uses, such as growing bioenergy crops and establishing new forests.\r\rOn the other hand, there is also the possibility to increase the proportion of ruminants raised in feed-lot systems using the “Livestock (grains/residues fed)” lever, as well as the numbers of ruminants per hectare in grazing systems (i.e., animal density) by using the “Livestock (pasture fed)” lever, which can reduce the need for additional pasture and the emissions per unit of meat produced. "), detailed_lever_guides_w40(), "'Detailed lever guides'!W40");
  assert_equal(EXCEL_STRING("The global average split of meat types in 2050 equals the 2011 split of meat types in Canada (28% from ruminants). This represents an extreme increase in the global average share of consumed meat that is from ruminants."), detailed_lever_guides_x40(), "'Detailed lever guides'!X40");
  assert_equal(EXCEL_STRING("The global average split of meat types in 2050 equals that projected by the UN’s Food and Agricultural Organisation (FAO) (25% from ruminants). This represents an increase in the global average share of consumed meat that is from ruminants."), detailed_lever_guides_y40(), "'Detailed lever guides'!Y40");
  assert_equal(EXCEL_STRING("The current global average split of meat types stabilises and stays the same until 2050 (22% ruminants). In this pathway, there is no change in the types of meats consumed."), detailed_lever_guides_z40(), "'Detailed lever guides'!Z40");
  assert_equal(EXCEL_STRING("The global average split of meat types in 2050 equals the 2011 split of meat types in China (10% ruminants). This represents an extreme reduction in the global average share of consumed meat that is from ruminants."), detailed_lever_guides_aa40(), "'Detailed lever guides'!AA40");
  assert_equal(EXCEL_STRING("1 Alexandratos, N.; Bruinsma, J. (2012). World Agriculture Towards 2030/2050: The 2012 Revision. FAO Report, ESA Working Paper No. 12-03, June 2012. Global Perspective Studies Team, UN FAO, Rome."), detailed_lever_guides_ab40(), "'Detailed lever guides'!AB40");
  assert_equal(EXCEL_STRING("This lever controls the global average yield of all food crops, used to feed both humans and animals."), detailed_lever_guides_u41(), "'Detailed lever guides'!U41");
  assert_equal(EXCEL_STRING("Between 1961 and 2007 global average crop yields (the amount of food produced per area of land) increased by 1.7% per year, owing to increased mechanisation, increased fertilisation and irrigation use, and improved crop varieties. Crop yields are predicted to continue to rise up to 2050, albeit at a lower rate; the UN's Food and Agricultural Organisation (FAO) project that between 2005/7 and 2050, global average cereal yields will increase by 0.8% per year, corresponding to a total increase in global average yield between 2011 and 2050 of 36%.  \r\rAn increase in crop yields means that less land will be needed to produce the same amount of food. As the world’s food needs are expected to increase, more land will be needed for food crops which may lead to deforestation. Improving crop yields can reduce this pressure on forests and other natural habitats. \r"), detailed_lever_guides_v41(), "'Detailed lever guides'!V41");
  assert_equal(EXCEL_STRING("Many experts consider that there is significant potential for crop yields to continue to increase to 2050, particularly in developing countries where the difference between actual yields and potential yields based on agro-ecological parameters is large. There are several ways to increase crop yields, including improving crop varieties to increase their (i) photosynthetic efficiencies, (ii) tolerance to pests, diseases, saline conditions and drought, and (iii) efficiencies of water and nutrient use.  This can involve traditional plant breeding methods (annual selection of higher yielding seeds, and the development of new varieties), marker assisted breeding and/or genetic modification (GM: the insertion of specific genes into the genes of a target plant, often from a separate species).\r\rTraditional plant breeding methods have been adopted for centuries, whilst GM methods have only been developed over the past few decades. However, GM crops are already planted on 170 million hectares (WRI, 2013), representing 12% of total cropland area in 2011; the majority (90%) of GM crops are currently grown in the United States, Canada, Brazil, Argentina and India. The potential implications of GM crops are currently heavily debated. Issues of contention include the potential ecosystem impacts and toxicity of GM crops, human health and safety and the socioeconomic impacts on farmers related to the higher cost, and ownership and control of GM seeds and products in comparison to conventional production practices. \rThe use of more fertilisers and irrigation can also increase crop yields, if the required resources (water, energy) are available. However, as well as being energy and greenhouse gas intensive, increasing these inputs can have negative impacts on the environment. For example, fertilisers can cause eutrophication (a rapid increase in algal growth which starves the water of oxygen, killing fish and other creatures) if allowed to run off into water bodies, affecting local biodiversity. Irrigation can affect local hydrological conditions, impacting soil and water quality. However, if best practice is applied, these impacts should be minimised. \r\rTo represent a move towards an organic farming system in the Global Calculator, crop yields are likely to be lower than industrialised systems, therefore between Level 1 to level 2 for crop yields would be most appropriate. On a global average, organic crop yields tend to be lower than those of industrialised systems. This would likely result in more land being required to grow crops compared to industrialised systems, and hence could result in deforestation to make way for more agricultural land unless offset to some extent by a concurrent increase in land use efficiency. However, organic farming could have benefits on existing arable land by, for example, reducing soil erosion, the use of synthetic fertilisers and pesticides, and increasing biodiversity.\r\rFinally, it is important to bear in mind that climate change could impact crop yields in the future. For example, increases in temperature could result in increased weather variability, more frequent and intense extreme events, and changes in precipitation, which in turn could lead to reduced and more variable crop yields. On the other hand, increased carbon dioxide levels could potentially result in improved yields for some types of crops.  Low to moderate yield increases (level 1 to 2) are likely to be the most appropriate if you have chosen a pathway with high temperature increases (>4 degrees) to reflect the potential adverse impacts of climate change on agricultural production."), detailed_lever_guides_w41(), "'Detailed lever guides'!W41");
  assert_equal(EXCEL_STRING("Crop productivity stays constant between 2011 and 2050, rather than following the current trend of increased productivity. This could be due to negative impacts of climate change on agriculture, and scarcity of key resources such as water and fertilisers. This could also represent a shift to more organic farming."), detailed_lever_guides_x41(), "'Detailed lever guides'!X41");
  assert_equal(EXCEL_STRING("Moderate crop yield increase of 40% above 2011 levels in 2050, similar to that forecast by the UN's Food and Agriculture Organisation (FAO) as a likely trend."), detailed_lever_guides_y41(), "'Detailed lever guides'!Y41");
  assert_equal(EXCEL_STRING("High crop yield increases of 60% above 2011 levels in 2050, based on linear extrapolation of past yield growths between 1960 and 2005 taking grains as a reference. This level of effort assumes an increase in the use of mechanisation, irrigation, fertilisers, biotechnology, a high increase in photosynthetic efficiencies, and technology transfer between developed and developing countries.  This level also assumes that climate change does not adversely impact crop yields."), detailed_lever_guides_z41(), "'Detailed lever guides'!Z41");
  assert_equal(EXCEL_STRING("Extreme yield increase of 100% above 2011 levels in 2050. This ambitious level of effort assumes a substantial increase in the use of mechanisation, irrigation, fertilisers and biotechnology, a high increase in photosynthetic efficiencies, and technology transfer between developed and developing countries.  This level also assumes that climate change has potentially positive impacts on crop yields."), detailed_lever_guides_aa41(), "'Detailed lever guides'!AA41");
  assert_equal(EXCEL_STRING("1 Alexandratos and Bruinsma (2012), World agriculture towards 2030/2050: the 2012 revision, FAO. Available at: http://www.fao.org/economic/esa/publications/details/en/c/147899/"), detailed_lever_guides_ab41(), "'Detailed lever guides'!AB41");
  assert_equal(EXCEL_STRING("This lever controls the increase in efficiency of land from 2011 to 2050 produced through the use of land integration schemes, for example multi-cropping.  This concept is different from crop yield improvements, which are controlled by other levers that just calculate how much land is required to produce a given amount of energy when land is dedicated to that purpose only."), detailed_lever_guides_u42(), "'Detailed lever guides'!U42");
  assert_equal(EXCEL_STRING("If land management is integrated more in the future and used for multiple purposes such as multi-cropping (where more than one harvest takes places each year), co-cropping (where two or more crops are grown together), and agro-livestock-forestry schemes, less land may be required to achieve the same outputs than if each land use was managed separately. However, if arable land is cultivated less intensively, more land may be required. "), detailed_lever_guides_v42(), "'Detailed lever guides'!V42");
  assert_equal(EXCEL_STRING("The Multiple Cropping Index (MCI) is a measure of the total harvested area for crops, in comparison to the total arable land dedicated to crops. Currently, in some warm climates with irrigation, or sufficient rainfall, crops are harvested more than once per year, hence the MCI is greater than 1; for example, the MCI of China was 1.45 in 2013 (Langeveld et al, 2013). However, if land is cropped less than once per year (e.g. some land is left fallow), the MCI is less than 1; for example, the MCI of the USA was 0.84 in 2013. If increased cropping intensities caused the global average MCI to increase in the future, less land would be required to produce the required amount of food, hence the land use efficiency would increase.\rSome studies have predicted that significant increases in cropping intensities could be technically feasible in the future, via more multi-cropping and reduced fallow periods. The UN's Food and Agricultural Organisation (FAO) (Alexandratos and Bruinsma, 2012) project that between 2005/7 and 2050, the global average MCI will increase from 0.88 to 0.92; this represents a change in the land required to produce the crops (assuming constant yields) from 100% in 2005/7 to 95.5% in 2050. \r\rHowever, the environmental implications of such increased cropping intensities will depend on where and how the intensification occurs. For example, long-term fallow land that is harvested infrequently can have substantial carbon reserves and provide important ecosystem services, therefore cultivating this type of land more frequently could result in increased carbon emissions to the atmosphere, and declining ecosystem services (WRI, 2013). However, if arable land that is technically suitable for multi-cropping is used, such schemes could result in improvements in land-use efficiency, without having detrimental environmental implications.  In contrast, with mismanaged land use, such as multi-cropping on land not suitable to such practices, yields could decrease because of soil degradation, soil loss and/or desertification and could result in a net increase of land area required to produce the same amount of output (decrease in land use efficiency).\r\rAnother way to increase the integration of land use, and potentially the land-use efficiency, is to use agroforestry, where trees and shrubs are integrated on land with crops and/or livestock production. Agroforestry schemes are already deployed in many regions, including Latin America, Asia and Africa. As well as potentially reducing overall land requirements, there are other potential environmental benefits of such schemes, including fixing nitrogen in the soils, reducing soil erosion, increasing soil organic matter, and increasing pasture yields in hot regions by providing shade and hence reducing animal stress. For example, in Kenya, Zambia and Malawi, nitrogen-fixing tree species (e.g. Faidherbia) are being intercropped with crops, improving the nitrogen content of soils. In other regions, shrubs with high-protein leaves (e.g. Leucaena) are being inter-cropped to provide forage for livestock (WRI, 2013). These schemes have proved very successful and are therefore increasingly being deployed in other countries."), detailed_lever_guides_w42(), "'Detailed lever guides'!W42");
  assert_equal(EXCEL_STRING("10% more agricultural land would be necessary to meet the selected food/livestock/bioenergy production levels in 2050 than in 2011. This level could reflect mismanaged land use, causing soil degradation, soil loss and/or desertification, resulting in agricultural land having to be left fallow more frequently than in 2011."), detailed_lever_guides_x42(), "'Detailed lever guides'!X42");
  assert_equal(EXCEL_STRING("No land use efficiency improvements. This level assumes that the current global integration of agricultural systems and practices remains stable until 2050. No further improvements or damages from land multi-use would be expected by 2050."), detailed_lever_guides_y42(), "'Detailed lever guides'!Y42");
  assert_equal(EXCEL_STRING("Improvement in land integration, meaning that 10% less agricultural land would be required to meet the selected food/livestock/bioenergy production levels in 2050 than in 2011. This level would entail an increase in integrated agricultural land use management, such as agro-forestry, crop rotations, multi-cropping, reduced fallow periods, co-cropping and no tillage technologies (where planting seeds without the need for ploughing reduces soil erosion and improves the carbon content of soil). "), detailed_lever_guides_z42(), "'Detailed lever guides'!Z42");
  assert_equal(EXCEL_STRING("Extreme improvement in land use efficiency, meaning that 30% less agricultural land would be required to meet the selected food, livestock and bioenergy production levels in 2050 than in 2011. This level would entail a substantial increase in integrated agricultural land use management, such as agro-forestry-, crop rotations, multi-cropping, reduced fallow periods, co-cropping and no tillage technologies."), detailed_lever_guides_aa42(), "'Detailed lever guides'!AA42");
  assert_equal(EXCEL_STRING("1 Alexandratos and Bruinsma (2012), World agriculture towards 2030/2050: the 2012 revision, FAO. Available at: http://www.fao.org/economic/esa/publications/details/en/c/147899/\r2 Langeveld et al (2013) Analyzing the effect of biofuel expansion on land use in major producing countries: evidence of increased multiple cropping. In Biofuels, Bioprod. Bioref.\r3 WRI (2013). Creating a Sustainable Food Future. A menu of solutions to sustainably feed more than 9 billion people by 2050.\r"), detailed_lever_guides_ab42(), "'Detailed lever guides'!AB42");
  assert_equal(EXCEL_STRING("This lever controls the global average proportion of ruminant livestock (e.g. cows, sheep and goats) that are reared in confined systems and fed on grains, food waste and agricultural residues. It also controls how efficiently these animals convert their food into meat. It also controls the feed conversion ratio of non-ruminant livestock (it is assumed all non-ruminants are fed on grains and residues)."), detailed_lever_guides_u43(), "'Detailed lever guides'!U43");
  assert_equal(EXCEL_STRING("Ruminant livestock (e.g. cows and other bovines, sheep and goats) can be reared on pasture or in intensive and semi-intensive feed-lot systems where they are fed on grains and residues. Currently, intensively produced beef represents approximately 6% of all beef, and 1% of all sheep and goat meat produced globally. Since the 1990s, livestock production has been shifting from more developed countries to developing countries, and this pattern is projected to continue towards 2050 (Alexandratos and Bruinsma, 2012). Developing countries currently produce less than 1% of their beef from intensive systems, whereas developed countries produce around12% from such systems. Therefore the shift of beef production to developing countries could result in reduced intensification of beef production. However, intensification of livestock systems is generally associated with economic growth, therefore it is expected that there will be a gradual shift towards more intensive feed-lot systems in developing countries in the future; this could compensate for the shift of livestock production from developed to developing countries. \r\rIt is expected that global average feed conversion efficiencies of grain/residue fed animals will increase in the future due to genetic improvements, as well as improved animal feeds.\r"), detailed_lever_guides_v43(), "'Detailed lever guides'!V43");
  assert_equal(EXCEL_STRING("Livestock produced in intensive systems are generally much more efficient at converting biomass food to meat, and therefore require much less land than pasture-fed animals. For example, in 2011 an area the size of a football pitch would typically yield ~ 380,000 kcal per year of intensively managed beef, but only ~ 26,000 kcal per year of pasture fed beef, i.e., almost 15 times less. Shifting more towards intensively produced animals could therefore free up land for other uses, such as newly established forests and bioenergy plantations. \r\rHowever, intensive livestock operations are currently a source of environmental and health problems. Large amounts of manure are produced in confined areas, and its collection, storage and application to land can pose significant challenges; for example, if too much manure is added to nearby land, it can run-off into local water systems, causing water and soil pollution. There are also concerns of odour and air pollution associated with feedlot systems. Another issue is that antibiotics are often used in large quantities in feedlot systems, with potential health implications for humans (e.g. increased human resistance to antibiotics). \r\rMany people are also concerned about the health and welfare impacts on animals by keeping them in confined, intensive conditions, as well as using selective breeding (for example, to make them more muscular).\r"), detailed_lever_guides_w43(), "'Detailed lever guides'!W43");
  assert_equal(EXCEL_STRING("Reduction in the proportion of animals that are in feedlot systems to zero in 2050. This represents a case where we move away from intensive feedlot systems, and towards more ‘free range’ systems. Low increase in feed conversion efficiencies of animals (see table above for values)."), detailed_lever_guides_x43(), "'Detailed lever guides'!X43");
  assert_equal(EXCEL_STRING("No change in the proportion of cattle, sheep and goat meat produced from feedlot between 2011 and 2050. Moderate increases in the feed conversion efficiencies of animals (see table above for values)."), detailed_lever_guides_y43(), "'Detailed lever guides'!Y43");
  assert_equal(EXCEL_STRING("Moderate increase in feedlot systems to15% of all cattle, sheep and goat meat produced by 2050. Moderate/high increase in feed conversion efficiencies of animals (see table above for values). This level entails more use of conventional animal genetic improvements, and technology transfer from developed to developing countries."), detailed_lever_guides_z43(), "'Detailed lever guides'!Z43");
  assert_equal(EXCEL_STRING("High increase in feedlot systems by 2050 to 30% of all cattle, sheep and goat meat produced by 2050. High increase in feed conversion efficiencies of animals (see table above for values). This level entails significantly more use of conventional animal genetic improvements, and technology transfer from developed to developing countries."), detailed_lever_guides_aa43(), "'Detailed lever guides'!AA43");
  assert_equal(EXCEL_STRING("1 Alexandratos and Bruinsma (2012), World agriculture towards 2030/2050: the 2012 revision, FAO. Available at: http://www.fao.org/economic/esa/publications/details/en/c/147899/"), detailed_lever_guides_ab43(), "'Detailed lever guides'!AB43");
  assert_equal(EXCEL_STRING("This lever controls the global average efficiency of meat production from pasture fed livestock (for example, cows, sheep and goats), by changing the number of animals per hectare, and how efficiently the animals convert forage to meat energy."), detailed_lever_guides_u44(), "'Detailed lever guides'!U44");
  assert_equal(EXCEL_STRING("Ruminant livestock (e.g. cows and other bovines, sheep and goats) can be reared on pasture or in intensive feed-lot systems where they are fed on grains, food waste and residues. Currently, pasture-fed beef represents approximately 94% of all beef, and 99% of all sheep and goat meat produced globally (FAO, 2006); pasture systems are projected to continue to provide the majority of beef and sheep meat in 2050.\r\rThe yields of livestock fed on pasture can be increased by grazing more animals per hectare, as well as by increasing the feed conversion efficiency of the animals (the kcalories of meat produced per kcalorie of biomass the animal consumes). It is thought that there is significant potential to increase pasture-fed livestock yields globally, particularly in countries with land availability for livestock production or by increasing the animal density in existent pasture systems."), detailed_lever_guides_v44(), "'Detailed lever guides'!V44");
  assert_equal(EXCEL_STRING("Pasture land currently covers 3.4 billion hectares of the world, representing 26% of the overall global land area (excluding deserts, ice sheets, degraded lands). If global consumption of pasture-fed ruminant meat increases in the future, more pasture land will be required unless increases in efficiencies are able to counterbalance this increased meat requirement. Increases in pasture area could lead to further deforestation, with the associated greenhouse gas emissions and impacts on biodiversity. Alternatively, if pasture yields and other land use efficiency measures (controlled by the “Land-use efficiency” lever which allows greater multi-cropping and land use integration) were increased significantly, this pasture expansion could be prevented, or even reversed so that some pasture land is freed up in the future and used for either reforestation or dedicated bioenergy crop production.  \r\rThere are several methods for increasing pasture yields. For example, pastures could be planted with grasses and legumes that are more digestible than typical pasture forage, and fields could be fertilised to produce greater quantities of forage. This could increase the number of animals that the land could support, as well as raising the feed conversion efficiency of the animals (if the forage is more digestible). Grains and oilseed meals could also be used as a supplement feed to grass, to help maintain the animal’s growth during dry or cold seasons. \r\rAlternatively, grazing methods can be improved so that pasture land is used more efficiently; for example, by rotating animals quickly around different areas of a field so that grass growth is optimised, or by mixing cattle and sheep grazing so that their different grazing patterns complement each other. Agro-livestock integration can also maximise the land use and increase the overall productivity. Finally, genetic improvements could also be used to increase the feed conversion ratio of ruminants, and reduce their production of methane."), detailed_lever_guides_w44(), "'Detailed lever guides'!W44");
  assert_equal(EXCEL_STRING("Low increase in pasture animal density (10%) and feed conversion ratio of pasture-fed cows and sheep and goats (from 2.0% to 2.1%), by improved animal husbandry. "), detailed_lever_guides_x44(), "'Detailed lever guides'!X44");
  assert_equal(EXCEL_STRING("Moderate increase in pasture animal density (30%) and feed conversion ratio of pasture-fed cows and sheep and goats (from 2.0% to 2.2%), by improved animal husbandry."), detailed_lever_guides_y44(), "'Detailed lever guides'!Y44");
  assert_equal(EXCEL_STRING("High increase in pasture animal density (50%) and feed conversion ratio of pasture-fed cows and sheep and goats (from 2.0% to 2.4%). This entails the use of conventional animal genetic improvements, improved animal husbandry, and improved pasture management."), detailed_lever_guides_z44(), "'Detailed lever guides'!Z44");
  assert_equal(EXCEL_STRING("Extreme increase in pasture animal density (80%) and feed conversion ratio of pasture-fed cows and sheep and goats (from 2.0% to 2.8%). This entails the use of conventional animal genetic improvements, improved animal husbandry, and improved pasture management. Furthermore, this level involves much technology transfer from developed to developing countries to achieve higher levels of productivity."), detailed_lever_guides_aa44(), "'Detailed lever guides'!AA44");
  assert_equal(EXCEL_STRING("1 FAO (2006). Livestock’s long shadow:  Environmental issues and options. Available at: http://www.fao.org/docrep/010/a0701e/a0701e00.HTM \r2 WRI (2013). Creating a sustainable food future: A menu of solutions to sustainably feed more than 9 billion people by 2050."), detailed_lever_guides_ab44(), "'Detailed lever guides'!AB44");
  assert_equal(EXCEL_STRING("This lever controls the global average energy yield of bioenergy crops. The yield is the annual amount of energy in the form of biomass that can be grown on a given unit of land."), detailed_lever_guides_u45(), "'Detailed lever guides'!U45");
  assert_equal(EXCEL_STRING("In order to produce a given amount of bioenergy, the amount of land we need depends on the bioenergy crop yield, as controlled by this lever. \r\rLiquid biofuels are primarily produced in the USA, Brazil, Europe and China from food crops (known as first generation feedstocks). For example maize, sugar cane and wheat can be made into ethanol, and oilseed rape, soybean and palm fruits can be made into biodiesel. The yield of these crops varies between regions and crop type. For example, the energy yield of wheat grown in Europe is currently around 2,500 litres of ethanol per hectare, whereas the energy yield of sugar cane grown in Brazil is about 7,500 litres of ethanol per hectare."), detailed_lever_guides_v45(), "'Detailed lever guides'!V45");
  assert_equal(EXCEL_STRING("This lever considers not only the increase in energy crop yields, but also a change in the crop mix. For example, more efficient energy crops are likely to prevail in future bioenergy investments, particularly with the advancements of new technologies, such as using a more efficient mix of first generation feedstocks, or using second-generation biofuels made through lignocellulosic processes. These feedstocks are generally woody or grassy, such as switchgrass, sugarcane, Miscanthus, napier grass, and eucalyptus, rather than food crops. If we were to move towards using these ‘second generation’ energy crops in the future, the energy yield would be expected to increase.\r\rImprovements in crop varieties should also result in increased yields of energy crops in the future. In the literature, annual increases for global average yields of woody energy crops up to 2050 are projected to be 1.2–1.6% (AEA, 2011), corresponding to an increase of 59% - 86% increase in 2050 over 2011 yields. These improvements could be achieved using traditional plant breeding methods (annual selection of higher yielding seeds, and the development of new varieties) or genetic modification (the insertion of specific genes into the genes of a target plant, often from a separate species). \r\rThe “land use efficiency” lever also affects how much bioenergy can be produced per unit of land."), detailed_lever_guides_w45(), "'Detailed lever guides'!W45");
  assert_equal(EXCEL_STRING("Low yield increases for energy crops, to a value in 2050 that is 20% greater than the average 2011 yield (equivalent to an average annual increase of 0.5% per year). This level represents a case where the bioenergy crops used are primarily first generation feedstocks, such as wheat, maize, sugarcane, oilseed rape, and palm fruits, or where climate change has negative impacts on yields."), detailed_lever_guides_x45(), "'Detailed lever guides'!X45");
  assert_equal(EXCEL_STRING("Moderate increase in energy crop yields, to a value in 2050 that is 50% greater than the average 2011 yield (equivalent to an average annual increase of 1.1%/year). This level represents a case where the mix of energy crops changes from primarily first generation biofuel crops to incorporate more high-yielding, second generation energy crops such as short rotation coppice (SRC) hardwoods, eucalyptus, Miscanthus and switch grass."), detailed_lever_guides_y45(), "'Detailed lever guides'!Y45");
  assert_equal(EXCEL_STRING("High yield increases for energy crops, to a value in 2050 that is 120% greater than the average 2011 yield (equivalent to an average annual increase of 2.0%/year). This level represents a case where the mix of energy crops changes from primarily first generation biofuel crops to primarily high-yield, second generation energy crops. As well as the switch from first to second generation crops, the yield of the second generation energy crops increases between 2011 and 2050."), detailed_lever_guides_z45(), "'Detailed lever guides'!Z45");
  assert_equal(EXCEL_STRING("Extreme increase in energy crop yields, with 2050 yields 200% greater than the average 2011 yield (equivalent to an average annual increase of 2.9%/year). This level represents a case where the mix of energy crops changes from primarily first generation biofuel crops to primarily high-yield, second generation energy crops. As well as the switch from first to second generation energy crops, the yield of the second generation energy crops increases greatly between 2011 and 2050."), detailed_lever_guides_aa45(), "'Detailed lever guides'!AA45");
  assert_equal(EXCEL_STRING("1 AEA (2011). UK and Global Bioenergy Resource – Final report.\r2 Campbell et al. (2008). Environ. Sci. Technol. 2008, 42, 5791–5794.\r3 Hoogwijk et al. (2003). Biomass and Bioenergy. 25. 119 to 133."), detailed_lever_guides_ab45(), "'Detailed lever guides'!AB45");
  assert_equal(EXCEL_STRING("This lever controls the global average proportion of the energy content of modern bioenergy in either solid or liquid forms. "), detailed_lever_guides_u46(), "'Detailed lever guides'!U46");
  assert_equal(EXCEL_STRING("If your pathway generates surplus land (which depends on your choices for food consumption, agricultural yields and land-use efficiency), and you choose to expand energy crops in this remaining land by 2050, then you can decide using this lever if the bioenergy produced from such expansion would be mainly in liquid or solid forms.\r\rCurrently around 60% of modern bioenergy is in solid forms (e.g. wood pellets and chips) and 40% is in liquid form (bioethanol and biodiesel).\r"), detailed_lever_guides_v46(), "'Detailed lever guides'!V46");
  assert_equal(EXCEL_STRING("There are advantages of using bioenergy in both solid and liquid forms, therefore it is currently not possible to state which is preferential. \r\rSolid biomass can be used in industry for process heat requirements, for example to produce high temperature steam, which is likely to be difficult to decarbonise using other technologies. It can also be used alongside carbon capture and storage (known as BECCS, which stands for biomass energy with carbon capture and storage); this could have the advantage of generating ‘negative emissions’, because the carbon dioxide absorbed from the atmosphere as the energy crops grows would get locked away under the Earth’s surface in this process.\rLiquid biofuels can be used to generate low carbon aviation and shipping fuels, and fuels for heavy goods vehicles. These applications are likely to be hard to decarbonise using other methods, therefore using biomass for this use has significant benefits.\r\rIf you choose a high proportion of liquid biofuels, and your pathway generates a lot of bioenergy, you may also want to choose low levels of transport electrification for the lever \"Electric and hydrogen\", otherwise you may end up with some unused bioenergy crops.\r"), detailed_lever_guides_w46(), "'Detailed lever guides'!W46");
  assert_equal(EXCEL_STRING("The share of liquid biofuels falls to 20% (half its 2011 value) of total bioenergy by 2050, and solid biomass increases from 60% to 80%. This level could represent a case where technological changes would result in a reduction in demand of liquid biofuels, for example, the electrification of transport. It could also represent a case where BECCS is seen as an important method of removing carbon dioxide from the atmosphere."), detailed_lever_guides_x46(), "'Detailed lever guides'!X46");
  assert_equal(EXCEL_STRING("The mix of liquid and solid bioenergy forms remains constant between 2011 and 2050, at 40% of the total bioenergy as liquid. This level assumes no substantial changes from the current pattern of bioenergy use."), detailed_lever_guides_y46(), "'Detailed lever guides'!Y46");
  assert_equal(EXCEL_STRING("The share of liquid biofuels increases between 2011 and 2050 from 40% to 60% of total bioenergy. This level represents a case where liquid biofuels are increasingly used as renewable fuels, as new technologies enhance the competitiveness of advanced biofuels, e.g. lignocellulosic ethanol and biomass-to-liquids (Fischer-Tropsch).  "), detailed_lever_guides_z46(), "'Detailed lever guides'!Z46");
  assert_equal(EXCEL_STRING("The share of liquid biofuels increases significantly between 2011 and 2050, from 40% to 80% of total bioenergy. This level represents an extreme case, where liquid biofuels are increasingly used as renewable fuels, as new technologies enhance the competitiveness of advanced biofuels.  "), detailed_lever_guides_aa46(), "'Detailed lever guides'!AA46");
  assert_equal(EXCEL_STRING("This lever controls how any surplus land made available after 2011 is allocated. In the Global Calculator, surplus land (after accounting for food production) can be allocated to the regeneration of forest and grasslands, to the production of bioenergy crops, or both."), detailed_lever_guides_u47(), "'Detailed lever guides'!U47");
  assert_equal(EXCEL_STRING("After accounting for food production, surplus land can be allocated for the regeneration of forests and grassland and/or bioenergy crops. Surplus land is made available in the model when existing land is no longer needed for food production (either due to changes in diet, improvements in food yields, food waste reduction or land use efficiency)."), detailed_lever_guides_v47(), "'Detailed lever guides'!V47");
  assert_equal(EXCEL_STRING("This lever controls how any surplus land made available after 2011 is used. There are advantages to using land for the establishment of new energy crop plantations, and for new forests.\rNew energy crop plantations established on abandoned agricultural land would provide a source of low-carbon energy that could be used for a number of different applications, including liquid fuels for transport (e.g. road, aviation and shipping fuels) and solid fuels for heat and power generation. In conjunction with a deployment of carbon capture and storage technologies, this could potentially result in negative greenhouse gas emissions (known as BECCS – biomass energy with carbon capture and storage). Energy crop plantations can also be used to restore soils, enhance soil carbon stocks and help prevent flooding by increasing the water retention capacity of soils. \r\rThe establishment of new forests would result in increased carbon being absorbed from the atmosphere and being stored on the land in the form of trees and in the soil. It would also have other environmental benefits, such as providing habitats for wildlife, preventing flooding and restoring soils, as well as providing green space for local populations.\r\rIt is important to note that the growth rates of newly established forests, and the final amount of carbon they store, would vary significantly depending on the region and climate. For the purposes of the Global Calculator, average carbon stocks of all current forests and savannahs have been used to provide a global average value, and it is assumed that the forests will become fully established after 50 years. \r"), detailed_lever_guides_w47(), "'Detailed lever guides'!W47");
  assert_equal(EXCEL_STRING("Any surplus land (achieved through climate-smart dietary, yield improvement and positive land-use efficiency choices) is allocated to forests (including natural regeneration and planted forests) and the restoration of natural grasslands. "), detailed_lever_guides_x47(), "'Detailed lever guides'!X47");
  assert_equal(EXCEL_STRING("Levels 2 and 3 represent surplus land use between levels 1 and 4. In level 2, 40% of any surplus land is used for bioenergy and the remaining 60% for forests and grassland restoration."), detailed_lever_guides_y47(), "'Detailed lever guides'!Y47");
  assert_equal(EXCEL_STRING("Levels 2 and 3 represent surplus land use between levels 1 and 4. In level 3, 60% of any surplus land is used for bioenergy and the remaining 40% for forests and grassland restoration."), detailed_lever_guides_z47(), "'Detailed lever guides'!Z47");
  assert_equal(EXCEL_STRING("The majority (80%) of any surplus land is allocated to the establishment of bioenergy crop plantations."), detailed_lever_guides_aa47(), "'Detailed lever guides'!AA47");
  assert_equal(EXCEL_STRING("This lever controls how much biochar technology is used."), detailed_lever_guides_u48(), "'Detailed lever guides'!U48");
  assert_equal(EXCEL_STRING("Biochar technology is still not used in 2050."), detailed_lever_guides_x48(), "'Detailed lever guides'!X48");
  assert_equal(EXCEL_STRING("Biochar technology removes 0.3 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_y48(), "'Detailed lever guides'!Y48");
  assert_equal(EXCEL_STRING("Biochar technology removes 0.8 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_z48(), "'Detailed lever guides'!Z48");
  assert_equal(EXCEL_STRING("Biochar technology removes 3.3 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_aa48(), "'Detailed lever guides'!AA48");
  assert_equal(EXCEL_STRING("This lever controls how much direct air capture technology is used."), detailed_lever_guides_u49(), "'Detailed lever guides'!U49");
  assert_equal(EXCEL_STRING("Direct air capture technology is still not used in 2050."), detailed_lever_guides_x49(), "'Detailed lever guides'!X49");
  assert_equal(EXCEL_STRING("Direct air capture technology removes 1.0 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_y49(), "'Detailed lever guides'!Y49");
  assert_equal(EXCEL_STRING("Direct air capture technology removes 2.5 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_z49(), "'Detailed lever guides'!Z49");
  assert_equal(EXCEL_STRING("Direct air capture technology removes 10.0 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_aa49(), "'Detailed lever guides'!AA49");
  assert_equal(EXCEL_STRING("This lever controls how much ocean fertilisation technology is used."), detailed_lever_guides_u50(), "'Detailed lever guides'!U50");
  assert_equal(EXCEL_STRING("Ocean fertilisation technology is still not used in 2050."), detailed_lever_guides_x50(), "'Detailed lever guides'!X50");
  assert_equal(EXCEL_STRING("Ocean fertilisation technology removes 0.1 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_y50(), "'Detailed lever guides'!Y50");
  assert_equal(EXCEL_STRING("Ocean fertilisation technology removes 0.3 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_z50(), "'Detailed lever guides'!Z50");
  assert_equal(EXCEL_STRING("Ocean fertilisation technology removes 1.0 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_aa50(), "'Detailed lever guides'!AA50");
  assert_equal(EXCEL_STRING("This lever controls how much enhanced weather (oceanic) technology is used."), detailed_lever_guides_u51(), "'Detailed lever guides'!U51");
  assert_equal(EXCEL_STRING("Enhanced weather (oceanic) technology is still not used in 2050."), detailed_lever_guides_x51(), "'Detailed lever guides'!X51");
  assert_equal(EXCEL_STRING("Enhanced weather (oceanic) technology removes 1.0 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_y51(), "'Detailed lever guides'!Y51");
  assert_equal(EXCEL_STRING("Enhanced weather (oceanic) technology removes 2.5 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_z51(), "'Detailed lever guides'!Z51");
  assert_equal(EXCEL_STRING("Enhanced weather (oceanic) technology removes 10.0 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_aa51(), "'Detailed lever guides'!AA51");
  assert_equal(EXCEL_STRING("This lever controls how much enhanced weather (terrestrial) technology is used."), detailed_lever_guides_u52(), "'Detailed lever guides'!U52");
  assert_equal(EXCEL_STRING("Enhanced weather (terrestrial) technology is still not used in 2050."), detailed_lever_guides_x52(), "'Detailed lever guides'!X52");
  assert_equal(EXCEL_STRING("Enhanced weather (terrestial) technology removes 0.4 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_y52(), "'Detailed lever guides'!Y52");
  assert_equal(EXCEL_STRING("Enhanced weather (terrestial) technology removes 0.9 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_z52(), "'Detailed lever guides'!Z52");
  assert_equal(EXCEL_STRING("Enhanced weather (terrestial) technology removes 3.7 GtCO<sub>2</sub>/year by 2050."), detailed_lever_guides_aa52(), "'Detailed lever guides'!AA52");
  assert_equal(EXCEL_STRING("This lever controls the global average production of food wastes and agricultural residues, and the amount recovered for other uses (for example, energy production or animal feed). Here, food waste is defined as food suitable for human consumption that is lost or wasted along the food value chain. Residues are defined as biomass produced during food production that is not suitable for human consumption, such as straw and leaves."), detailed_lever_guides_u53(), "'Detailed lever guides'!U53");
  assert_equal(EXCEL_STRING("This lever controls the proportion of farm residues that are collected for energy production, the proportion of produced food that is not eaten by humans (post-farm waste), and the proportion of the energy content of food waste that is collected for energy production. All waste is measured in terms of the energy content, rather than mass.\r\rFood is wasted along the entire value chain, including the production of food on the farm, handling and storage, food processing, packaging and distribution, and finally at the consumption level (at the home or in restaurants). In 2011, 24% of crop energy, and 19% of meat energy, was wasted globally after leaving the farm (Lipinski et al., 2013). Total food waste generally ranges between 15% and 25% of food energy produced across most regions, apart from the USA where around 42% of food energy is wasted. There is therefore significant potential to reduce food waste. Between 2007 and 2010, food waste reduced by 13% in the United Kingdom, as a result of a successful campaign. In 2012, the European Commission set a target of reducing food wastage in Europe by 50% by 2020.\r\rAs well as reducing the amount of food that we throw away, we could also improve how we treat food waste and agricultural residues produced on the farm. For example, more could be used to generate energy by anaerobic digestion. In the Global Calculator, a proportion of recovered ‘wastes and residues’ is used for energy production and/or animal feed. By reducing post-farm waste generation and improving waste and residue collection efficiencies across the food supply chain, the environmental impact of food production (including greenhouse gas emissions) can be reduced significantly."), detailed_lever_guides_v53(), "'Detailed lever guides'!V53");
  assert_equal(EXCEL_STRING("The stage where most food is wasted is different for developed and developing countries. For example, over half of food energy wasted in North America, Oceania and Europe occurs at the consumption stage (i.e. people throwing food away), whereas in South and Southeast Asia, and sub-Saharan Africa, two-third to three-quarters of food waste occurs during its production, handling and storage (WRI, 2013; Institution of Mechanical Engineers, 2013). \r\rThere are several ways to reduce food wastage. For example, in developing countries, simple, low-cost storage options could be provided to low-income farmers to help preserve food. Improved roads, access to electricity, and refrigeration could also reduce losses from food production, handling, transport and storage in developing countries. In developed countries, consumer waste could be reduced by improving packaging so that food lasts longer and providing advice to consumers on food storage and the difference between ‘sell-by’ and ‘use by’ dates. Finally, if food waste was monitored and measured more effectively, this would help countries and companies to reduce their food wastage."), detailed_lever_guides_w53(), "'Detailed lever guides'!W53");
  assert_equal(EXCEL_STRING("No change in the collection of on-farm residues or the production of post-farm wastes and residues. A low increase in the collection of post-farm wastes and residues for energy. See table above for values."), detailed_lever_guides_x53(), "'Detailed lever guides'!X53");
  assert_equal(EXCEL_STRING("Moderate increase in the collection of on-farm residues. A moderate reduction in the production of post-farm wastes and residues. A moderate increase in the collection of post-farm wastes and residues for energy. See table above for values."), detailed_lever_guides_y53(), "'Detailed lever guides'!Y53");
  assert_equal(EXCEL_STRING("Significant increase in the collection of on-farm residues. A significant reduction in the production of post-farm wastes and residues. A significant increase in the collection of post-farm wastes and residues for energy. See table above for values."), detailed_lever_guides_z53(), "'Detailed lever guides'!Z53");
  assert_equal(EXCEL_STRING("Extreme increase in the collection of on-farm residues. An extreme reduction in the production of post-farm wastes and residues. An extreme increase in the collection of post-farm wastes and residues for energy. See table above for values."), detailed_lever_guides_aa53(), "'Detailed lever guides'!AA53");
  assert_equal(EXCEL_STRING("1 Institution of Mechanical Engineers (2013) Global food – Waste not, want not. Available at:  http://www.imeche.org/docs/default-source/reports/Global_Food_Report.pdf?sfvrsn=0\r2 Lipinski, B. et al. 2013. Reducing Food Loss and Waste. Working Paper, Instalment 2 of Creating a Sustainable Food Future. Washington, DC: World Resources Institute. Available at: http://www.worldresourcesreport.org"), detailed_lever_guides_ab53(), "'Detailed lever guides'!AB53");
